         "positionInfo": "😊 자란다를 소개 합니다.\n자란다는 아이들의 돌봄과 교육에서 발생하는 문제를 데이터와 추천 알고리즘으로 해결하는 ‘에듀테크 스타트업’입니다.\n.\n우리는 세상의 아이 수만큼 다양한 성장 방식이 필요하다고 믿습니다. 그래서 아이들의 일률적인 성장 방식에서 벗어나 내 아이에게 맞는 방식으로 성장할 수 있도록 유아동 시장을 혁신하고 있습니다. 또 우리는 아이들의 관심사, 학업 성취도 등을 분석할 수 있는 국내 유일의 ‘성장 데이터’와 내 아이에 맞춰 선생님과 프로그램을 매칭하는 “추천 알고리즘” 을 구축하고 있습니다.\n.\n이를 통해, 전년 대비 이용 가정 수 4배 증가, 매칭 만족도는 97%라는 기록을 세웠고, 업계 최대 규모인 138억의  누적 투자로 시장에서 우리의 가치를 인정받았습니다. 또 최근 네이버, 라인, 바이브컴퍼니 출신의 구성원들이 합류하면서 더 큰 도약을 준비 중 입니다.\n.\n이제 우리는 단순 프로그램 및 선생님 추천을 넘어, 아이들의 성장에 필요한 모든 솔루션을 모아 종합적인 ‘키즈 플랫폼’으로 나아가고자 합니다. 꾸준히 데이터와 플랫폼을 통해 유아동 시장을 혁신하고 있는 우리는. 자란다입니다.\n.\n.\n😎 이렇게 합류해요!\n_____________________\n1. 서류접수 → 2. 화상인터뷰 → 3. 팀 리드 인터뷰 → 4. 컬처핏 인터뷰 → 처우협의\n.\n.\n📄 합류과정을 상세히 말씀 드릴게요!\n_____________________\n1. 서류는 HWP파일을 제외한 자유로운 형식으로 제출해 주세요.\n2. 화상인터뷰에서는 개발 팀 리드와 화상으로 직무와 관련된 기본적인 지식에 대해 이야기를 나누는 단계 입니다. 또 직무역량, 경험에 대해 이야기를 나누는 단계예요. (약 40분 내외 ± 15 분 )\n3. 팀 리드 인터뷰에서는 실제로 함께 일할 팀원들과 실무 경험을 바탕으로 실무 중심으로 면접 진행 하고 있습니다. (약 50분 ± 10 분)\n4. 컬처핏 인터뷰는 서로가 추구하는 문화와 일하는 방식에 대해 이야기를 나누는 단계예요. 그리고 포지션에 대한 전문성을 다시금 확인하는 단계이기도 합니다. (약 50분 ± 10 분)\n.\n.\n🤔 자란다의 NLP는?\n_____________________\n‘NLP 엔지니어’ 직무는, 자란다 앱에서 생성되는 부모들의 ‘수업 신청서’, 아이들의 ‘방문 일지’ 등의 자연어 데이터에서 폭넓은 추천 시스템을 위한 키워드 정보를 추출, 관리할 수 있도록 관련 개발을 담당하는 업무입니다.\n.\nNLP(Natural Language Processing) 영역에서, 언어 모델의 고도화나 지능화 등에 관련된 업무 영역보다는, 실질적으로 라이브 서비스에 적용될 수 있는 솔루션을 개발하는 업무입니다. 그러므로 Linguistics나 Scientist도 필요할테지만, Engineer 역량이 훨씬 더 중요합니다.\n.\n기계학습이나 통계분석에 대한 전문성보다, 개발자로서의 팀워크, 현업에 적용되는 프로젝트 관리 능력, 라이브 서비스에서의 지식 구축 경험 등이 풍부한 분을 뽑고자 합니다.\n.\n.\n👨‍💻👩‍💻자란다 NLP 엔지니어로 합류하게 된다면?\n_____________________\n자란다 서비스를 위한 자연어처리 기반 추천시스템 구현을 할 수 잇습니다.\n-형태소 분석, 개체명 인식, 구문 분석 등 자연어 처리 모듈 및 API 개발을 합니다.\n-메타데이터 구축 및 자체 사전(dictionary) 관리 백엔드 개발을 합니다.\n-키워드 벡터화(vectorizer)를 통해 기존 자란다 추천 시스템과 결합한 콘텐츠 추천 모델 개발을 합니다.\n.\n.",
