         "positionInfo": "😊 자란다를 소개 합니다.\n자란다는 아이들의 돌봄과 교육에서 발생하는 문제를 데이터와 추천 알고리즘으로 해결하는 ‘에듀테크 스타트업’입니다.\n.\n우리는 세상의 아이 수만큼 다양한 성장 방식이 필요하다고 믿습니다. 그래서 아이들의 일률적인 성장 방식에서 벗어나 내 아이에게 맞는 방식으로 성장할 수 있도록 유아동 시장을 혁신하고 있습니다. 또 우리는 아이들의 관심사, 학업 성취도 등을 분석할 수 있는 국내 유일의 ‘성장 데이터’와 내 아이에 맞춰 선생님과 프로그램을 매칭하는 “추천 알고리즘” 을 구축하고 있습니다.\n.\n이를 통해, 전년 대비 이용 가정 수 4배 증가, 매칭 만족도는 97%라는 기록을 세웠고, 업계 최대 규모인 138억의  누적 투자로 시장에서 우리의 가치를 인정받았습니다. 또 최근 네이버, 라인, 바이브컴퍼니 출신의 구성원들이 합류하면서 더 큰 도약을 준비 중 입니다.\n.\n이제 우리는 단순 프로그램 및 선생님 추천을 넘어, 아이들의 성장에 필요한 모든 솔루션을 모아 종합적인 ‘키즈 플랫폼’으로 나아가고자 합니다. 꾸준히 데이터와 플랫폼을 통해 유아동 시장을 혁신하고 있는 우리는. 자란다입니다.\n.\n.\n😎 이렇게 합류해요!\n______________________________\n1. 서류접수 → 2. 화상인터뷰 → 3. 팀 리드 인터뷰 → 4. 컬처핏 인터뷰 → 처우협의\n.\n.\n📄 합류과정을 상세히 말씀 드릴게요!\n______________________________\n1. 서류는 HWP파일을 제외한 자유로운 형식으로 제출해 주세요.\n2. 화상인터뷰에서는 개발 팀 리드와 화상으로 직무와 관련된 기본적인 지식에 대해 이야기를 나누는 단계 입니다. 또 직무역량, 경험에 대해 이야기를 나누는 단계예요. (약 40분 내외 ± 15 분 )\n3. 팀 리드 인터뷰에서는 실제로 함께 일할 팀원들과 실무 경험을 바탕으로 실무 중심으로 면접 진행 하고 있습니다. (약 50분 ± 10 분)\n4. 컬처핏 인터뷰는 서로가 추구하는 문화와 일하는 방식에 대해 이야기를 나누는 단계예요. 그리고 포지션에 대한 전문성을 다시금 확인하는 단계이기도 합니다. (약 50분 ± 10 분)\n.\n.\n🤔 자란다의 백엔드 엔지니어?\n______________________________\n자란다의 백앤드 팀은 자란다 시스템에 발생되는 모든 데이터와 기술을 바탕으로 운영도, 신규 서비스 구축도 해볼 수 있습니다. 또 우리는 주로 자란다 플랫폼 서비스의 API, 자동화 콤포넌트 모듈 및 관리자 도구를 만들고 있습니다. 빠르게 성장하는 서비스에 잘 대응하기 위해 다양한 아키텍처가 서로 연결되도록 설계하고 서비스에 적용해 나가고 있으며 대부분의 백엔드 서비스는 구글 클라우드 플랫폼(GCP)에서 운영 합니다.\n.\n.\n🎱 만약 자란다의 백앤드 엔지니어로 합류하게 된다면?\n______________________________\n백엔드 엔지니어로 합류하시게 되면 자란다의 개인화 추천 시스템 /프로그램/커머스/마케팅도구 분석 개발 중 ■ 하나 ■ 를 담당하시게 되며 좋은 동료들과 함께 안정적인 서비스를 만드는 데 기여하실 수 있습니다.\n.\n[개인화 추천 시스템]\n아이의 정보, 부모의 신청내용에 따라 자란다만의 추천알고리즘 시스템 고도화 및 플랫폼 아키텍처 설계\n.\n[프로그램]\n프로그램MD, 혹은 제휴사가 요청하는 수업 조건 components를 바탕으로 새로운 프로그램을 생성할 수 있는 시스템 개발\n신청된 수업에 따른 매칭과 이 후 일정 및 가이드 자동 생성 시스템\n.\n[커머스]\n카드결제, 계좌이체, 펌뱅킹, iamport, 카카오페이 등의 각종 결제시스템 구축 및 연동\n부모님/ 선생님 앱 기능 및 운영시스템 개발\n채팅 및 정산 등 운영 시스템\n.\n.\n👩‍💻 자란다의 백앤드 스텍도 말씀 드리겠습니다!\n______________________________\n대부분의 서비스는 구글 클라우드 플랫폼(GCP)에서 운영되고 있습니다.\n.\n- App Engine을 기반으로 주로 Python 언어를 쓰고 있으며 webapp2, Flask, FastAPI 등의 프레임워크를 쓰고 있습니다. Node.js 기반의 Express 프레임워크 역시 쓰고 있습니다.\n- MySQL, Firebase, FireStore, BigQuery 등의 DBMS를 사용하여 데이터를 저장, 가공하고 서비스에 반영합니다.\n- Pub/Sub, Task Queue 등의 비동기 모듈과 Cron 자동화 모듈을 통해 다양한 작업을 운영합니다.\n.\n.\n🌭자란다의 개발 문화는 어떤 가요?\n______________________________\n마이크로 서비스 아키텍처를 지향하며 이를 토대로 서비스를 재구성하고 있습니다.\n자란다 개발팀에는 거대한 데이터와 계속 증가 하고 있는 트레픽을 운영을 해볼 수 있는 기회가 있습니다. 뿐만 아니라, 방대한 양의 데이터와 우리의 기술을 바탕으로 신규 서비스를 구축해 볼 수도 있죠. 큰 시스템을 개발하는 것을 지양하고 계획을 작게 나누어 우리의 서비스를 점진적으로 발전 시켜 나가고 있습니다.\n.\n.",
