         "positionInfo": "프로덕트팀 개발자로서 모두싸인의 백엔드 애플리케이션 설계 및 구현, 더 나은 고객 경험을 제공하기 위한 서비스 개선 및 최적화 활동, 인하우스/백오피스 서비스 개발을 진행합니다.\n일주일의 스프린트 주기를 가지는 사이클에서 PM, 프론트엔드 개발자와 주로 협업하게 되며, 이 과정에서 웹 서비스 프로젝트 과업의 시작부터 완료까지 추진하는 책임을 가지게 됩니다.\n우리는\n- 실제 코드 구현에 들어가기 전, 중요한 비즈니스 규칙 추출하고, 모델링 하는 과정에 많이 투자하고 있어요.\n- Domain-Driven Design이 권장하는 전략적/전술적 패턴과, 이벤트 스토밍 들을 활용하고 있어요.\n- Typescript와 Nest를 사용하여 개발하고 있으며, 객체지향 프로그래밍, 계층화된 아키텍처를 사용해요.\n- 비즈니스 영역의 관심사를 기준으로 서비스를 분리하여 마이크로서비스 아키텍처를 구성하고, 운영하고 있어요.\n- AWS를 사용하여 인프라를 구축하고, 각 서비스를 컨테이너화 하여 ECS 환경에서 배포 및 운영합니다.\n최근에 진행한 작업 몇 가지를 통해 어떤 일을 하게 될 지 살펴보실 수 있어요.\n- 조직 기준으로 권한을 부여하거나, 이전하도록 권한 관리 개선\n- 추가 사용자에 대한 정기 결제가 가능하도록 시스템 개선\n- 최대 5000명까지 한번에 계약 요청을 할 수 있도록 Queue를 사용한 비동기 작업 관리 및 최적화\n- 서명요청 건 별로 과금하던 결제 모델을 기능 별 요금제를 통한 구독형 결제 모델로 전환\n- 고객의 기존 시스템에 모두싸인을 통합할 수 있는 API 개발\n- 서비스 장애 복구 및 성능 개선 활동을 돕기 위한 모니터링 고도화\n- 백엔드 애플리케이션 개발에 사용하는 공용 패키지(DDD, Event publisher/subscriber 등) 개발\n　\n주요 기술 스택\n- NodeJS, Typescript, Nestjs\n- MySQL (AWS Aurora)\n- Jest\n- Docker, Docker-compose\n- AWS (ECS, SNS, SQS, API Gateway 등)\n- Terraform",
