         "positionInfo": "영어 교육에 가장 많은 시간과 돈을 투자하지만 활용 능력이 가장 떨어지는 나라가 대한민국이라는 말을 들어보셨나요?  iPortfolio는 <철학 있는 기술로 교육을 개혁한다>는 사명하에 영어를 배우고 가르치는 방식을 효율적으로 바꿔나가고 있습니다.\n옥스포드 대학출판부와 협력하여 개발한 디지털 교과서 플랫폼 Oxford Learner's Bookshelf를 시작으로, 아이들을 위한 디지털 영어 학습 서비스 READING &과 Oxford Reading Club을 통해 국내를 넘어 중국, 일본, 터키, 스페인 등의 국가에서 영어를 배우고 가르치는 방법을 바꿔나가고 있습니다.\n더 많은 사람들이 제대로 영어를 배울 수 있도록 서비스를 만들어 나갈 동료를 찾고 있습니다.\n[개요]\n우리는 올바른 영어 교육 방법을 IT 서비스에 녹여내고 있습니다.\n서비스를 함께 만들어나갈 프론트엔드 개발자를 모십니다.\n[주요 서비스]\niPortfolio는 영어 교육을 개혁하기 위해 지난 10년간 달려왔습니다. 옥스포드 대학출판부와 협업하여 개발한 디지털 교과서 플랫폼 Oxford Learner's Bookshelf를 시작으로, 아이들을 위한 디지털 영어 학습 서비스 READING &과 Oxford Reading Club을 통해 국내는 물론 중국, 일본, 터키, 스페인 등의 국가로 서비스를 확장해 나가고자 합니다.\n\n리딩앤 (READING &)\n\n국내에서 서비스 중인 디지털 영어 학습 서비스\n\n\nOxford Learner's Bookshelf\n\n60개국 이상에서 사용 중인 영국 옥스포드 대학출판부의 공식 디지털 교과서 플랫폼\n\n\nOxford Reading Club\n\n리딩앤 서비스의 글로벌 버전으로 해외 40개 나라에 공급 중인 디지털 영어 리딩 서비스\n\n\n\n\n\n[함께하게 될 업무]\n1. 빠르게 성장하는 리딩앤 (READING &) 서비스 개발 및 운영\n\n리딩앤 서비스는 빠르게 성장하고 있습니다. 양질의 콘텐츠를 갖고 있는 출판사들의 요청으로 신규 아동용 도서 시리즈를 계속해서 론칭하고 있습니다. 시리즈가 론칭될 때 마다 새로운 기능들을 빠르게 추가하여 고객들에게 올바른 영어 교육의 가치를 전달하고 있습니다.\n리딩앤 서비스의 웹 어플리케이션을 개발/운영하게 됩니다. 고객의 요구사항을 분석하여 개발하고, 오류를 수정하며 재사용 가능한 UI Component를 개발하는 경험을 하게 됩니다.\n\n2. 빠르게 확장하는 Oxford Reading Club 서비스 개발 및 운영\n\nOxford Reading Club 서비스는 올해 스페인, 브라질, 칠레, 페루, 콜롬비아, 태국, 대만 등 7개국에 수출하는 계약을 성사했습니다.\n일본, 터키에서 사용 중인 Oxford Reading Club 서비스를 글로벌 서비스로 확장하는 과정에서 웹 애플리케이션을 같이 만들어 나가게 됩니다. 글로벌 서비스를 운영한다는 것은 국내 서비스를 운영하는 것과 또 다른 경험을 안겨줄 것입니다.",
