         "positionInfo": "# 스와치온\n패션 크리에이터들을 위한 리소스 플랫폼\n스와치온은 패션 디자이너들에게 IRL (In Real Life) 패션 제작에 필요한 원단 등의 소재와, 디지털 패션 컨텐츠 제작에 필요한 3D패브릭, 가먼트패턴, 3D모델링 등의 리소스를 제공하는 라이브러리 서비스입니다.\n업계 최대 규모의 리소스 라이브러리를 바탕으로, IRL 패션브랜드들이 NFT 마켓과, 제페토/IMVU 등의 메타버스 플랫폼에서 디자인을 상품화하고 판매할 수 있도록 도와주는 플랫폼으로 역할을 넓혀가고 있습니다.\nIRL 패션 디자이너가 메타버스에서도 자신의 상품을 판매할 수 있도록,\n메타버스에서 시작한 크리에이터가 IRL 패션에서도 자신의 가치를 증명할 수 있도록,\n패션 크리에이터들이 현실세계와 메타버스를 넘나들며 창작활동을 할 수 있는 플랫폼을 만드는 것이 우리의 목표입니다.\n스와치온은 IRL 패션 소재 커머스 플랫폼으로 창업하여, 누적 100억원의 투자를 유치했습니다.\n지금은 20여만개의 소재 데이터베이스를 보유한, 북미/유럽 등지의 전세계 1.5만여 패션브랜드가 사용하는 서비스가 되었습니다.\n2020년, 소재 데이터를 3D 패션 디자인에서 사용할 수 있는 디지털 소재로 제작하여, 디지털 패브릭 라이브러리를 오픈했습니다.\n전세계에 있는 패션브랜드 유저 베이스와 압도적인 규모의 소재 데이터를 바탕으로, IRL 패션과 디지털 패션을 연결하는 플랫폼으로 성장해가고 있습니다.\n# 기업문화\n• 성과에는 최고 수준으로 보상합니다.\n• 시간을 들인 노력이 가져다주는 가치를 믿습니다.\n• 목표를 공유하고 서로의 생각을 이해하는 것에 충분한 시간을 투자합니다.\n• 작은 아이디어를 빠르게 실행에 옮기고 결과를 만들어내는 것을 즐깁니다.\n• 실패는 없습니다. 안 되는 것이 무엇인지 알아낸 겁니다.\n• 조직은 개인을 신뢰하고, 개인은 조직에 책임감을 갖습니다.\n# 복지\n• 최고 수준 장비 지원\n• 자기계발(강의 등) 및 도서구입 비용, 세미나 참가비 무한 지원\n• 간식과 커피 무한 제공\n• 종합건강검진\n• 장기근속 안식휴가 : 3년 근속 후 1개월\n• 경조사비 및 휴가 / 법정 연차휴가 제공 / 명절 상여금\n• 4대보험\n스와치온 플랫폼의 백엔드를 함께 만들어나갈 개발자를 모십니다.\n다음의 4가지 업무 분야 중 하나에 지원하실 수 있습니다.\n— 커머스 : 주문 관제\n# 업무\n• 전세계 1만여개 패션브랜드들과 1천여개 패션 소재 판매업체들을 연결하는 주문 관제 시스템을 개발합니다.\n• 주문 관리 시스템 개발\n• 발주 관리 시스템 개발\n• 결제 / 정산 시스템 개발\n# 자격요건\n• AWS 와 Linux 사용에 익숙하며, 네트워크 및 클라우드 지식이 있는 분\n• 관련 학과 전공자 내지는 그에 준하는 경력\n• Rails 또는 Node.js 환경에서의 개발에 익숙하신 분\n# 우대조건\n• 웹 프론트에 대한 이해 (HTML, CSS, JS, jQuery 또는 Vue.js)\n• 커머스 개발 경험\n— 커머스 : 물류 관리\n# 업무\n• 판매자들로부터 받은 상품이 주문고객들에게 빠르고 정확하게 배송될 수 있도록 물류처리를 통제하는 시스템을 개발합니다.\n• 물류 입고/검수/출고 관리 시스템 개발\n• 재고 관리 시스템 개발\n• 수출통관 관리 시스템 개발\n# 자격요건\n• AWS 와 Linux 사용에 익숙하며, 네트워크 및 클라우드 지식이 있는 분\n• 관련 학과 전공자 내지는 그에 준하는 경력\n• Rails 또는 Node.js 환경에서의 개발에 익숙하신 분\n# 우대조건\n• 물류 관리 혹은 커머스 개발 경험\n— 커머스 : 데이터\n# 업무\n• 상품 검색엔진과 큐레이션 알고리즘을 운영하고, 마케팅팀과 협업하여 검색 및 판매 데이터를 분석합니다.\n• 검색엔진 개발\n• 큐레이션 알고리즘 개발\n• 데이터 분석 기획, 데이터 추출, 대시보드 운영\n# 자격요건\n• AWS 와 Linux 사용에 익숙하며, 네트워크 및 클라우드 지식이 있는 분\n• 관련 학과 전공자 내지는 그에 준하는 경력\n• Python, SQL 구사에 능숙하신 분\n# 우대조건\n• Elasticsearch 운영 경험\n• Python Dash 개발 경험\n• Rails 개발 경험\n— 신사업 : 디지털 패션 스튜디오\n# 업무\n패션브랜드들이 상품을 디지털화하고 NFT 마켓, 메타버스 플랫폼 등에서 상품을 판매할 수 있도록 연결하는 플랫폼을 개발합니다. 현재 일부 스와치온 고객 브랜드를 대상으로 MVP 테스트 중에 있습니다.\n• 서비스 기획 및 설계 논의\n• 서비스 백엔드 개발\n• 어드민 백엔드 개발\n• 정산 시스템 개발\n# 자격요건\n• AWS 와 Linux 사용에 익숙하며, 네트워크 및 클라우드 지식이 있는 분\n• 관련 학과 전공자 내지는 그에 준하는 경력\n• Rails 또는 Node.js 개발 경험\n# 우대조건\n• 블록체인과 NFT 기술에 대한 이해",
