         "link": "https://programmers.co.kr/job_positions/7738",
         "positionInfo": "[출산율이 떨어지는데도 \"매월 300%씩 성장(?!)하는 임신/육아 서비스\"가 있다구요?!]\n마미톡은 출시 3개월만에 분만수 기준 전국 \"TOP10 산부인과 중 8곳\"이 사용하고, '강남차병원', '청담마리산부인과' 등 연예인 출산으로 유명한 곳을 포함 전국 130여 개 병원에서 사용 중인 \"임신, 육아 필수 앱\"이에요.\n-  임신·육아 앱 '마미톡' 론칭 6개월만 업계 1위 등극 (https://bit.ly/3oP8fiP)\n-  3위 ‘메디앤소프트(서비스명 마더스다이어리)’와 합병 계약 체결 (https://bit.ly/3nOTF9t)\n-  마미톡, 구글 플레이 스토어·애플 앱스토어 의료 분야 1위 등극 (https://bit.ly/3sx44uf)\n부부가 처음 임신을 하게 되면 산부인과에 방문해서 초음파 진료를 받게 되는데, 의사 선생님이 보여주는 귀엽고 소중한 태아 초음파 영상을 모바일 앱을 통해서도 볼 수 있도록 하는 게 마미톡의 핵심 기능이랍니다!\n-  플레이스토어에서 마미톡 기능 구경하기 (https://bit.ly/31K4PVP)\n-  앱스토어에서 마미톡 기능 구경하기 (https://apple.co/3dWlurC)\n더불어 산모들로부터 뜨거운 반응을 얻고 있는 '커뮤니티', 네이버 최저가보다 저렴하게 임신/육아용품 구매가 가능한 '마미몰'의 트래픽과 매출은 출시 후 \"매월 300% 이상 성장하며 매일 신기록을 경신\"하고 있어요!\n\n\n[마미톡의 성장, 한국은 시작일 뿐?]\n인도네시아는 연간 신생아 수가 무려 480만 명(한국 약 30만 명)에 달하는 거대한 시장임에도 불구하고 현지에 경쟁사가 전무한 매력적인 곳이에요.\n작년 런칭한 마미톡은 현지 법인을 통해 인도네시아 수도 자카르타 소재 산부인과/소아과 중심 대규모 종합병원인 RS.Gandaria 병원과 솔루션 사용계약을 체결하는 등 동남아시아 시장을 목표로 빠르게 성장하고 있답니다 :)\n\n\n[어떻게 이런 빠른 성장이 가능했을까요?]\n1. '스타트업계 어벤저스'를 방불케하는 슈퍼팀\n- 헬스케어/의료 분야 누적 220억 원 투자를 유치한 창업자- 대웅제약 임원 출신 영업팀- KAIST/연세대/고려대 등 명문대 출신 개발팀\n- 정보올림피아드 특기생 출신 개발자\n- 세계 대학생 프로그래밍 경진대회(ACM-ICPC) 입상 개발자\n- 리액트 장인 & Node.Js 10년차 개발자\n마미톡의 모든 구성원들은 이와 같은 화려한 이력과 경험은 물론 서로에 대한 배려와 겸손한 태도를 갖추고 있기 때문에, 회사와 개인이 동반 성장할 수 있는 최적의 환경이라고 자부한답니다!!\n\n2. 글로벌 헬스케어 기업 GE헬스케어가 선택한 그 회사\n마미톡은 전세계 초음파 의료장비 1위 업체인 'GE헬스케어'로부터 회사의 기술력을 인정받아 공식 업무협약을 체결하고 국내는 물론 전 세계 시장을 무대로 삼아 빠르게 성장하고 있어요.\n-  GE헬스케어 - 마미톡 솔루션 업무협약 (https://bit.ly/2D5NbRU)\n\n3. 대한산부인과초음파학회, 대한분만병원협회 등 의료계의 전폭적인 지원\n마미톡의 기술력은 의료계를 대표하는 학회, 협회에서도 인정을 받아, 공식 감수와 업무협약을 체결하고 전국의 주요 산부인과에서 쓰이고 있어요.\n어떤 산업보다 보수적인 의료계에서 기술력을 인정받고 성장의 토대를 마련한 만큼, 이제는 로켓을 타고 날아갈 일만 남았답니다!\n-  대한산부인과초음파학회 - 마미톡 업무협약 (https://bit.ly/38x7hjN)\n-  대한분만병원협회 - 마미톡 업무협약 (https://bit.ly/3ea5MJH)\n\n\n[끝장나게 멋진 기술 제품을 만들며 성장할 수 있어요!]\n1. 다양한 기술들을 다뤄볼 수 있어요\n마미톡은 다양한 기술들을 활용하고 있어요. 이미 각 분야에서 최고의 장인 수준인 개발자 분들이 함께 하시는 만큼, 일하면서 배울게 정말 많을거에요!\n서버 - Node JS, Socket\n클라이언트 - HTML5, CSS3, SASS, Typescript, React, React-Native, Electron, Swift, Kotlin\n데이터베이스 - AWS RDS (Mysql)\n배포 및 운영 - Jenkins, AWS Code Deploy, AWS Elastic beanstalk, AWS S3, AWS EFS, AWS CloudFront\n모니터링 - AWS CloudWatch, Sentry, Elastic stack\n유틸리티 - Python, C#\n협업 - Jira, Notion, Figma, Zeplin, Slack\n\n2. 흔치 않은 기술적 챌린지들을 해결하는 경험을 할 수 있어요\n마미톡은 수십만명의 산모들을 대상으로 쇼핑몰의 타임세일, 커뮤니티의 타임 이벤트를 진행하고 있는 만큼 수많은 기술적 챌린지들을 감당하고 해결해나가야 하는 서비스에요.\n인도네시아에서 수백만명의 산모들이 서비스를 이용하게 될 것인 만큼, 앞으로 기술적 안정성은 더더욱 중요해질거에요. 이런 챌린지들에 도전하는 것을 즐기는 분이라면, 마미톡에서 폭발적으로 성장하실 수 있을거에요!\n\n3. 끝내주는 데이터들을 다룰 수 있어요\n마미톡은 주별 리텐션이 50%나 될 정도로 활성화율이 높은 서비스에요. 그러다 보니 쇼핑몰 구매 데이터, 커뮤니티 활동 데이터 등 앱 전반적으로 엄청나게 많은 데이터가 발생하고 있죠.\n앱에 저장되는 초음파 동영상 데이터 역시 매월 수만 건이 쌓이고 있어요. 이런 풍부하고 멋진 데이터들을 활용해서 끝내주는 제품을 만들어 나가는 경험을 하게 되실 거에요!\n\n\n[지금 로켓에 올라타세요!]\n보시다시피 마미톡은 성장 속도가 미친듯이 빠른 로켓이에요. 페이스북 COO 셰릴 샌드버그는 \"로켓에 자리가 나면 그 자리가 어디 위치했는지 따지지도 말아라. 우선 올라타라\"고 말했죠.\n성장을 찾는 분이라면 마미톡 만한 로켓은 정말 드물어요. 마미톡 팀에 조금이라도 관심이 가신다면, 가벼운 티타임을 하는 마음으로 사무실에서 이야기를 나눠봤으면 좋겠어요. 그리고 로켓에 올라타기로 마음을 정하신다면, 회사와 함께 미친듯이 성장해요!\n\n\n주요 업무\n• AWS 환경에서 실행되는 다양한 서비스 운영과 관리\n• 앱 및 SPA 프론트에 적합한 API 개발\n• 건강하고 즐거운 개발 문화를 만드는데 기여",
