         "positionInfo": "팀 소개\n\n매스프레소의 Production Development Division은 매스프레소의 가장 핵심 제품인 QANDA의 개발을 책임지고 있는 Division입니다. 해적선 정신과 Start-up Spirit을 가슴에 품고, 고객이 만족하는 제품을 만들어 내는 것에 집중하고 있습니다.\n높은 수준의 제품 Quality 유지하는 것과 제품을 빠르게 개선하는 것을 매우 중요한 가치로 생각합니다. 이를 달성하기 위해서 실험하는 것을 좋아하며 데이터에 기반한 접근을 하기 위해 노력합니다.\nData Team은 Mathpresso의 구성원들이 목표를 달성하는 데 필요한 데이터를 적절히 활용할 수 있도록 서포트하고, 서비스/비즈니스가 올바른 방향으로 나아가고 있는지 데이터 관점에서 점검합니다.\n데이터 웨어하우스로 Bigquery 를 사용합니다. Bigquery의 뛰어난 성능을 활용하여 ETL 보다는 ELT paradigm 으로 데이터 파이프라인을 구현하고 있습니다. Extract/Load 단위 작업은 Apache Spark 어플리케이션으로 개발하여 AWS Fargate 로 실행합니다. 단위 작업들의 Workflow Orchestration 도구로 Apache Airflow (Cloud Composer) 를 사용합니다. 이외에도 로그 수집을 위해 Amazon API Gateway 와 Amazon Kinesis 서비스를 사용합니다. BI 는 Holistics 라는 서비스를 사용합니다.\n합류하시면 함께 풀어나갈 문제들입니다.\n\n데이터 파이프라인/데이터 웨어하우스 유지보수 : 프러덕트가 계속해서 성장함에 따라 수집해서 관리하여 분석에 활용할 데이터도 계속해서 늘어나고 있습니다. 이를 위해 데이터 파이프라인과 데이터 웨어하우스도 계속해서 관리되고 발전해야합니다.\n실험 (A/B 테스트) 데이터 집계와 분석 practice 통일 : 실험 플랫폼을 구성하는 것을 궁극적인 목표로, 첫 단계로, 목적 조직들마다 조금씩 다르게 이뤄지고 있는 (Firebase A/B Testing, 클라이언트 단에서 샘플링, 서버 단에서 샘플링 등) 실험 집행 practice 를, best practice 로 통일 시키려고 합니다. control/variant 값과 conversion event 등 실험을 정의할 때 필수적으로 & 공통으로 정의되는 데이터들을 수집하는 테이블의 스키마를 통일하고, 이를 사용하는 실험 결과 분석도 일관된 방식으로 이뤄질 수 있도록, 필요한 시스템을 구성하는 것을 목표로 합니다.\nData Catalog/Data Discovery : Production RDBMS, Firebase Analytics SDK 클라이언트 로그, 서버 로그, Adjust 같은 각종 서드파티 데이터 등 다양한 소스의 데이터가 데이터 웨어하우스로 모이고 있습니다. 현재 매스프레소가 어떤 데이터들을 수집하고 있고, 어떻게 활용되고 있는지 탐색을 도와주는 적절한 시스템의 필요성이 점점 더 커지고 있습니다. 당장에는 Bigquery 에서 Table/Column Description 을 어떻게 잘 관리할지를 고민하고 있습니다.\nData Engineer가 아니더라도 원하는 누구나 데이터 마트 테이블을 추가/수정 할 수 있도록 시스템 구성 : 원하는 데이터를 얻기 위한 SQL 은 다양한 모습일 수 있겠으나, ad-hoc 한 쿼리들이 계속 생겨나는 것을 방지하고, 적절히 추상화 된 데이터 모델 = 데이터 마트 테이블들이 정립되고 이를 재사용하는 것을 지향하는 것이 맞는 방향일 것입니다. 현재도 Data Analyst 를 비롯해 많은 Domain Owner 들이 데이터 모델에 대해서는 계속 고민하고 있으나, 이를 데이터 마트 테이블로 구현하는 것은, Airflow 에서 DAG/Task 작업이 필요하여 진입 장벽이 있기에 Data Engineer 만 하고 있습니다. 이를 개선하여, 데이터 모델을 정립한 당사자가 직접 데이터 마트 테이블까지 작업할 수 있는 방법에 대해 고민하고 있습니다. 최근에 업계에서 점점 더 많이 얘기되고 있는 DBT 등 여러 방법들을 탐색하고 있습니다.\nAirflow 직접 운영 : Managed Airflow 서비스인 Cloud Composer 를 활용해서 쉽고 빠르게 Airflow 환경을 구성할 수 있었습니다. 그러나 1년여간 사용하면서, Managed Service 이기에 어쩔 수 없는 몇가지 아쉬움들이 있었습니다. 그래서 뛰어난 Data Engineer 분들이 더 합류한다면 Amazon EKS 등의 Kubernetes 환경에서 Airflow 를 직접 운영하고자 합니다.",
