         "positionInfo": "대한민국 사람 4명 중 1명은 버즈니의 서비스 홈쇼핑모아를 사용하고 있습니다.\n\n[버즈니 소개]\n버즈니는 데이터기술로 생활의 가치를 더한다는 비전을 가지고, 더 똑똑하고 편리한 홈쇼핑 서비스를 제공하기 위해 계속해서 사업 영역을 넓혀가고 있습니다.  버즈니의 대표 서비스 \"홈쇼핑모아\"는 연간 15조 이상의 규모를 가진 홈쇼핑 시장에서 18개 홈쇼핑 및 T커머스 채널들의 홈쇼핑 정보를 통합해서 제공하고, 홈쇼핑사/종합몰/오픈마켓의 1억 건 이상의 상품을 검색 해주며, 출시 5년만에 누적 다운로드 1000만건을 넘었고 매월 약100만명의 이용자가 이용하며, 연간 1200억원 이상의 거래액을 내고 있는 명실상부 국내 1위 모바일 쇼핑 플랫폼입니다.\n버즈니는 그 가치를 인정받아 영국 파이낸셜 타임즈와 스태티스타(Statista)가 매년 아시아·태평양 12개 국가의 기업 중 가장 높은 성장률을 보이는 기업을 기준으로 총 500개 기업을 선정됐고, 버즈니는 아시아 태평양 고성장 기업 이커머스 부문 15위에 선정되었습니다. \n버즈니는 AI기술을 커머스 분야에 적용하면서 경험과 노하우가 쌓였고, 기술 추진 전략 및 방향성에 대한 자신감이 생겼습니다. 앞으로 커머스 AI 기술을 더욱 발전시켜 ‘홈쇼핑모아’ 뿐만 아니라, 비즈니스 파트너인 홈쇼핑사, 벤더사를 아우르는 등  홈쇼핑 업계 전반에서 빅데이터로 연결할 수 있는 홈쇼핑 생태계 플랫폼으로 성장해가기 위해 또 한번 도약을 준비하고 있습니다.\n[버즈니가 걸어온 성장의 즐거움]\n• 구글 플레이스토어, 애플 앱스토어 기준 모바일 홈쇼핑 포털 부문 1위\n• 홈쇼핑모아 월간 순 이용자수(MAU) 100만명 이상\n• 누적 다운로드 1,200만 \n• 1억건 이상의 상품 빅데이터, 1,200억 이상의 거래액\n• GSHS 10억, 소프트뱅크벤처스 60억 투자 유치\n• 고용노동부  '청년친화 강소기업' 버즈니 선정\n• 대한상공회의소 '일하기 좋은 중소기업' 버즈니 선정\n• 고용노동부 ‘일 생활 균형 우수기업’ 버즈니 선정\n• 아시아 태평양 고성장 기업 2020 버즈니 선정\n[버즈니 AI 백엔드 엔지니어(마케팅 분야) 직군을 소개합니다]\n버즈니 마케팅 팀은 연간 1500억원의 거래액을 내는 1000만 다운로드 앱 “홈쇼핑모아” 에 대해서 데이터, 기술, AI 등을 활용한 그로스 마케팅의 이점을 극대화한 방법으로 사용자를 크게 늘려 나갔습니다.\n마케팅 분야 AI 백엔드 엔지니어는 데이터를 기반으로 논리적이고 자동화된 방식으로 매달 수억원의 마케팅비의 효율을 극대화 하여 서비스 성장을 견인해 나가는 역할을 하게 됩니다.\n[이런일을 합니다.]\n• 키워드 검색 광고 최적화\n    – 통계 및 여러 자료를 취합해 효율이 좋은 검색 광고 키워드 예측 및 발굴\n    – 사용자 유입과 유저 액션을 분석하여 키워드 단가 조정 및 광고 순위 최적화\n    – 데이터 마이닝을 사용해 마케팅 전략 수립\n    – 웹 크롤링을 사용해 외부 데이터 수집 및 적재\n• 디스플레이 광고 최적화\n    – 서비스 타겟 사용자 자동 분류\n    – 개인화된 디스플레이 배너 광고 자동 생성\n    – 디스플레이 광고 개인화 및 최적화\n• 광고 효율 시각화 및 분석\n    – redash, kibana, Attribution, Jupyter Notebook 툴 등을 활용하여 광고 효율 시각화 및 분석\n• 데이터를 기반으로 마케팅 인사이트 도출\n   – 보유하고 있는 빅 데이터를 활용하여 마케팅 인사이트 도출",
