         "link": "https://programmers.co.kr/job_positions/7483",
         "positionInfo": "Working as Quality Engineers\n요기요의 Quality engineer들은 우리회사가 만드는 서비스의 최종 품질을 책임진다는 사명감을 갖고 일 합니다. 늘 완벽을 기하려고 노력하지만 소프트웨어의 품질이라는 것이 단순하지 않아서 예상치 못한 일들이 일어나곤 합니다.  하지만, 그것 또한 우리가 새로운 것을 배울 수 있는 기회라는 생각으로 모두가 학습할 수 있는 환경을 만들고 각자의 경험/기술을 공유하며 서비스의 개선과 개인의 성장이 같이 일어날 수 있도록 노력합니다.  구성원들 각각의 테스팅 경험과 기술의 폭을 넓혀가는 활동은 QE팀에게 가장 중요한 활동 중 하나이며, 이를 서로가 공유함으로써 효율적이고 디테일한 서비스 품질 보증을 만들어 가는 것은 물론 개인의 성장도 같이 꾀하고 있습니다.\n[What you will get]\n\n대규모 사용자를 가진 서비스의 품질을 확보하기 위한 다양한 기술과 테스팅 경험을 할 수 있고, 이를 통해  한층 더 성장할 수 있는 기회를 가질 수 있습니다. \nQA 경력이 적거나 혹은 없더라도 실무를 하면서 다양한 스킬과 이론을 배우고 적극적으로 Quality Engineer 커리어를 쌓아 나가고 싶은 의지가 있으신 분들을 찾고 있습니다. \n•  Cross-functional team의 일원으로 자신의 팀에서 담당하는 서비스의 기획부터 개발, 테스트, 배포, 모니터링까지 고객에게 서비스를 전달하기 위한 모든 과정에 참여하여 품질을 확보하는 경험을 하게 됩니다.\n•  Native app을 비롯해 MSA, 연동, 플랫폼 개발 등 다양한 서비스의 테스트를 경험할 수 있습니다.\n•  안정된 테스트 환경 속에서 지속적 배포를 경험해 볼 수 있습니다.\n•  다양한 분야에서 활약했던 경험 많은 구성원들과 함께 즐겁게 일 할 수 있습니다\n\n\n[What you will do]\n\n•  개발 진행 중 작은 단위(BE, API) 별 기능 테스트\n•  어플리케이션 릴리즈를 위한 기능 테스트\n•  서비스에 대한 모니터링과 리그레이션 테스트\n•  다양한 서비스 품질 개선 활동",
