         "link": "https://programmers.co.kr/job_positions/7184",
         "positionInfo": "한국금융솔루션은 국내 유일의 증권 기반 핀테크 스타트업이자 1세대 마이데이터 사업자로,\n2017년 코스콤 사내벤처로 출발해 지난 2019년에 분사한 3년차 스타트업 입니다.\n2021년 5월 75억원 규모로 시리즈A를 클로징하면서 현재 기준 누적투자액 규모는 약 110억원을 달성하였습니다.\n금융위 혁신금융서비스인 대출비교를 기반으로 대출·신용 관련 특화 서비스를 제공하는 플랫폼 핀셋N을 운영 중이며, \n핀셋N에 이어 더 나은 삶을 위한 시작, 내일의 아침을 노크하는 종합자산관리 플랫폼****베러데이를 22년 서비스를 목표로 준비 중에 있습니다. 또한, 2021년 9월 클라우드 네이티브 플랫폼 터플, 고객상담 솔루션 깃플챗으로 잘 알려진 클라우드 전문 기업 깃플과 합병을 하며, 새로운 한국금융솔루션으로 거듭났습니다.\n대출에서 투자까지 금융소비자의 핵심 문제를 해결하고,\n생활금융 전반의 고객 소통으로 차별화하는 투자까지 금융 시장의 새로운 패러다임에 동참하실 분을 모십니다.\n• 금융위 지정 1사 전속 규제 제외 혁신 사업자 선정 (대출비교서비스 사업 라이센스 취득)\n• 과기부 주관 마이데이터 실증사업자 선정 20년 7월 (소상공인연합회 컨소시엄 합류)\n• 금융위 주관 마이데이터 본심사대상 사업자 선정 20년 8월\n• 서울시 핀테크 지원 사업자 선정 여의도 위워크 입주\n• 디캠프 주관 공덕동 프론트원 입주 (단일 건물로는 세계 최대 면적의 엑셀러레이션 빌딩)\n• 과기부와 정보화진흥원이 주관하는 빅데이터센터 사업자 선정\n• 오픈뱅킹 사업자 사업인가\n• 코스콤과 공동으로 국내 최초 증권 오픈 API 개통\n• 서울신보와 공동으로 소상공인 보증상품 출시 비대면 인프라 구축 진행\n• 병역지정업체선정, 산업기능요원 복무 우대(보충역)\n포지션 소개\n깃플챗 솔루션 엔지니어는 영업팀과 개발팀을 이어주는 다리 역할로, 디지털 컨택센터 솔루션인 깃플챗(https://gitple.io)에 대해서 누구보다 폭넓은 이해를 바탕으로 이용 고객들의 기술 문제를 가장 쉽게 해결할 수 있도록 도와주는 사람입니다.\n\n주요업무\n• 고객 요구사항 파악 및 기술 문제 해결\n• 채팅/챗봇 시스템 구축 및 기술 전수\n• 프론트엔드 및 백엔드 시스템 유지보수",
