         "link": "https://programmers.co.kr/job_positions/4727",
         "positionInfo": "❝ 큐엠아이티는 기술로 스포츠 현장을 변화시켜 긍정적인 문화를 만들어내는 것을 꿈꾸고 있습니다. ❞\n\n스포츠 현장에서의 전문가들은 큐엠아이티의 '플코' 서비스를 가장 필요하면서도 가장 쉬운 시스템이라고 말합니다. 축구를 비롯한 여러 종목 구단이 스포츠 현장에서 '플코'를 이용하고 있으며, 다양한 연구 단체와 함께 연구 개발 협력을 지속하고 있습니다. 또한 기술력과 사업성을 인정받아 네이버, 롯데, KAIST청년창업투자지주, 상상투자조합 으로부터 투자를 유치하기도 했습니다.\n큐엠아이티는 함께 '플코' 서비스를 만들어갈 프로덕트 엔지니어를 채용하고 있습니다.\n\n큐엠아이티의 개발팀 소개\n\n\n\n개발팀 소개\n안녕하세요. 여러 스타트업에서 프론트, 백엔드, PM을 왔다 갔다 하며 풀스택으로 일하다가 QMIT 조인하여 개발팀 리드를 맡고 있는 Ryan 입니다.\n팀에 조인하면서 스크럼을 도입하여 애자일 문화를 만들고 있으며 이제 프로세스도 안정화되고 있는 단계가 되어 팀을 규모를 키우려 합니다. 좋은 팀, 좋은 프로덕트를 만들기 위해 함께 고민하고 성장중입니다.\n2020년 11월 스포츠 선수 스마트 관리 서비스인 PLCO 모바일 앱 출시, 2021년 2월 PLCO COACH 이후 꾸준히 업데이트 하여 현재는 MAU 1500명이 넘어 서고 있는 서비스를 운영중에 있습니다. 올해는 구독 기반 유료 서비스 전환을 계획하고 있어서 백엔드 파트를 함께 리드 하실 분 찾습니다.\n\n큐엠아이티의 개발 문화\n\n현재 적용 하고 있거나 앞으로 계속 해서 발전해 나갈 개발팀 문화 코드입니다.\n스크럼으로 애자일 실천합니다\n스크럼을 도입하고 애자일 문화를 만들고 있으며 이제 프로세스도 안정화되고 있는 단계입니다. 팀이 더나은 실행을 하기 위한 문화나 툴은 공격적으로 적용하고 실험하고 있습니다.\n유저 스토리로 함께 플래닝합니다\n플래닝 미팅은 매 스프린트 첫날 진행하며, PM, 디자이너, 개발자 모두 모여서 함께 고민하고 제품 플래닝을 결정하는 프로세스를 만들어 가고 있습니다\n구현 회의와 플래닝 포커로 개발 일정을 산출합니다\n플래닝 미팅에서 만들어진 유저 스토리들을 가지고 와서 아키텍처 부터 실제 어떤 식으로 구현 하면 좋을지에 대한 회의를 하고 실제 유저 스토리에 필요한 태스크들을 도출합니다. 도출한 태스크들을 기준으로 함께 일정 산출과 태스크 배분을 합니다. 그 후 PM 와 함께 스프린트에 포함될 유저 스토리를 한번 더 재 조정후 스프린트를 시작합니다. 이런 일련의 과정을 통해 계획과 실행의 균형을 잡아가려고 노력하고 있습니다.\n티켓 시스템으로 일합니다.\nNotion 으로 Kanban 보드를 운영하고 있으며 모든 업무는 티켓을 생성하여 이해관계자들과의 논의 부터 진척상황들을 업데이트 하여 팀간 개인간 커뮤니케이션을 티켓단위로 하려고 노력하고 있습니다.\n목표 중심 문화로 일합니다.\n엔지니어는 개발을 하는 팀원이 아니라 개발을 할 줄 아는 팀원입니다. 어디까지나 목표는 크게는 회사의 미션, 작게는 스프린트의 골을 달성하기 위해 일해야 합니다. 기능의 성공 적인 개발 여부는 기능 자체의 완성도가 아니라 만든 기능을 유저가 얼마나 좋아하는 가이며 이를 측정하기 위한 Analytics 엔지니어링은 기본 덕목입니다.\n\n큐엠아이티가 사용하는 기술 및 인프라\n\n\n\nNode.js, Javascript/Typescript\n백엔드 스택\n\nmoleculerjs 를 사용하려 MSA로구성되어 있으나 nest.js 로 이전 예정중\nGraphQL\nmysql, postgresql database\n\n\n프론트 스택\n\nReact / React-Native / next.js\nApollo\nrebass, styled-components\nmobx-state-tree\n\n\nGoogle Cloud Platform\n\nkubernetes\n\n\nCI/CD - Cloud Build\n그외 slack, notion, whimsical, google meet 등을 쓰고 있습니다.\n\n\n\n주요업무_Back end\n\n주요 업무 Duties\n\n\nPlco 관련 클라이언트 API 개발 - GraphQL 기반\nPlco 관련 인프라 서비스 운영 및 개발\n서비스 엔티티 및 DB 모델링",
