         "link": "https://programmers.co.kr/job_positions/6231",
         "positionInfo": "로민(Lomin)은 컴퓨터비전 기술을 사용하여 실생활과 산업 전반의 여러 문제를 해결하고자 하는 3년차 기술 스타트업입니다. 로민은 컴퓨터비전 분야에 탄탄한 전문성을 가진 엔지니어 위주로 구성되어있으며, 컴퓨터비전이 필요한 다양한 어플리케이션에 적용되는 핵심 엔진들을 개발해왔습니다. 현재까지 로민이 관심을 가진 분야는 업무자동화(서류인식), 보안(CCTV), 의료, 인프라 등 다양한 영역에 걸쳐있습니다.\n로민이 지금 집중하고 있는 분야는 사진으로부터 글자 정보를 추출해내는 문자인식(OCR) 기술입니다. 문자인식 기술은 컴퓨터비전 커뮤니티에서 오랜기간 연구, 개발되어 왔음에도 불구하고 여전히 충분한 성능을 보이지 않고 있으며 상용 소프트웨어들 중 클라이언트의 요구를 만족시키는 수준의 제품을 찾기 힘들기 때문입니다. 특히 문서인식의 수요가 많은 금융권에서 요구되는 기준은 매우 높기 때문에 사람과 같은 인식률의, 고신뢰 SW를 만드는 작업은 매우 도전적입니다.\n로민은 2019년 과기정통부 주최의 그랜드 AI 챌린지 문자인식 트랙에서 1위를 기록하여 OCR 엔진의 높은 성능을 입증받고, 2020년부터 본격적으로 국민카드, 교보생명, 삼성화재, 신한생명, 국가기록원 등의 다양한 기업 및 기관들과 협업하여 금융사를 비롯한 다양한 기업들에서 단순반복되는 서류 처리 업무를 자동화할 수 있는 솔루션을 개발 및 공급하고 있습니다.\nTextscope의 핵심은 어려운 상황에서도 마치 사람처럼 글자를 잘 인식하는 강력한 딥러닝 OCR 모델입니다. 뛰어난 성능의 OCR 엔진을 만들기 위하여 학습 데이터를 어떻게 생성, 관리, 적용할지 설계하는 것은 매우 어렵고 중요한 문제입니다. 데이터 엔지니어는 데이터의 관점에서 딥러닝 모델을 가장 효과적으로 학습시킬 수 있는 방법을 찾고 그 결과를 분석하는 업무를 수행합니다.\n구체적으로 데이터 엔지니어는 self-supervised learning과 human-in-the-loop 기법을 사용하여 OCR 데이터를 가장 효율적으로 라벨링하는 방법을 탐색합니다. 즉 모든 raw 데이터를 처음부터 사람이 라벨링하는 대신, 이미 높은 성능의 로민의 OCR을 사용하여 오토라벨링을 수행하고 이를 적절히 학습 데이터로 사용하거나 사람의 검수를 거친 후 데이터셋을 생성하는 가장 효율적인 방법을 연구합니다. 또 OCR의 대상이 되는 각종 복잡한 양식의 문서를 표현하는 데이터의 형태, 가공 방식 등을 정의하고 개선합니다. 데이터 팀에서는 로민의 데이터 생애주기를 전반적으로 관리하기 위하여 데이터의 수집, 분석, 가공을 위한 인프라를 설계하고 직접 구축합니다.\n\n\n데이터 레이크 & 데이터 가공 파이프라인 설계, 구축, 관리\n데이터셋 특성 분석, 통계 도출\n데이터 특성에 따른 OCR 모델 학습 결과 분석\nSelf-supervised learning, Human-in-the-loop 기법 연구",
