         "positionInfo": "클래스101은 '모두가 사랑하는 일을 하며 살 수 있도록'이라는 비전을 가진 팀입니다.\n불과 한 세대 전까지만 해도 '가죽 공예를 하면서 살겠다.' , '뜨게질을 하면서 살겠다' 라고 하면 아무도 믿지 않았습니다.\n혹은 자신이 사랑하는 일을 하고 싶다는 사람들에게 \"그게 돈이 돼?\" ,\"그걸로 어떻게 먹고 살려고해?\" 라는 이야기를 했습니다. 우리는 사람들이 자신이 사랑하는 일을 하면서도 멋지게 살 수 있는 세상을 만들고 싶습니다. 한 명이 '가죽공예를 하면서 살거야\"라고 하면 다른 한 명이 \"그래? 나는 꽃꽂이를 하면서 살거야\"라고 말하는 세상을 꿈꿉니다.\n2018년 3월, 준비물까지 챙겨주는 온라인 클래스 플랫폼을 만들었습니다. 예를 들어서 가죽공예 클래스를 결제했다고 하면, 클래스를 수강하는데 필요한 키트들을 집으로 보내드립니다. 온라인으로 클래스를 들으며 나만의 가죽제품을 만들 수 있습니다. 2021년 9월 초 기준, 약 2,200여개 클래스를 오픈했고 3,800만명의 방문자가 다녀갔습니다. 크리에이터분들이 사랑하는 일을 하실 수 있도록 약 520억원을 정산해드렸습니다.\n취미를 넘어서 커리어, 재테크, B2B등의 다양한 카테고리로 확장하여 온라인 클래스 플랫폼 국내 1등을 차지했습니다. 이 과정에서 좋은 동료들이 함께 하게 되었고,현재 350여명이 모여있습니다.\n우리는 지구 1등 온라인 클래스 플랫폼이 되고 싶습니다. 미국과 일본시장에서 순항 중에 있지만, 다양한 국가의 크리에이터분들과 수강생들(클래스메이트)에게 닿고 싶습니다. 그래서 더 많은 크리에이터분들이 클래스를 열고, 자신이 사랑하는 일을 하면서도 멋지게 살아가는 모습을 보여주고 싶습니다. 그리고 더 많은 클래스메이트들이 클래스를 통해서 꿈꾸기만 했던 자신이 사랑하는 일을 시작할 수 있기를 바랍니다.\n이 목표를 달성하기 위해서 착하고, 똑똑하고, 야망있는 더 많은 착똑야들과 함께 하고 싶습니다. 우리와 함께 세상을 바꿔보는 건 어떨까요? 당신은 착하고 똑똑하고 야망있는 사람인가요?\n\n주요업무\n\n클래스101 서비스 애플리케이션 운영 및 환경 표준화\nKubernetes 기반 인프라 구축 및 운영\nKubernetes 기반 배포 파이프라인 도구 개발 및 고도화",
