         "positionInfo": "유픽은 국내 유일의 해외 식품 전문 이커머스 플랫폼입니다. 트릿지에 속한 유픽 팀은 국내 소비자를 대상으로 소스, 잼, 과자, 향신료, 오일 등 주요 가공식품을 직수입해 판매합니다. 복잡하게 얽힌 국내외 유통 구조로 인해 국내 수입이 어려웠던 해외 가공 및 냉장·냉동식품을 국내 소비자도 손 쉽게 즐길 수 있도록 만드는 것이 목표입니다.\n유픽은 트릿지에서 선도 정신(radicality)을 최우선 가치로 삼고 사업을 성장시키고 있습니다. 한국에서 그 누구보다 빨리 국내 소비자의 트렌드를 파악해 복잡한 유통 과정을 뚫고 합리적인 가격에 상품을 수입해야 하기 때문입니다. 멕시코 칸테 아보카도 오일과 불가리아 루테닛사 등이 유픽의 대표 수입 상품 중 하나입니다. 해외 직소싱 전문가부터, 국내 유통, 온라인 서비스 기획 및 브랜딩, UI/UX 디자인 등 온·오프라인 전문가들이 식품 시장 혁신에 집중하고 있습니다.\n유픽 Frontend Software Engineer는 UI/UX 개선, 성능 최적화를 위해 항상 고민하고 개발합니다. 디자인, 마케팅 직군과 협업하며 주도적으로 개발합니다. React.js, Typescript를 사용하여 새로운 유픽, 어드민을 개발합니다(완료될 때까지 기존 서비스 유지보수 병행). 기술을 전환하는 과정을 통해 서비스 개발의 A to Z를 경험할 수 있고 코드 리뷰, 다른 개발자들과 자유롭게 대화하는 문화, 직무 관련 교육 지원 등을 통해 개발자로서 함께 성장할 수 있습니다.\n유픽 하이라이트\n- 2019년 4월 : 유픽 오픈\n- 2019년 대비 2020년 취급 상품 수 3배 증가\n- 2019년 대비 2020년 매출 21배 증가\n- 2020년 대비 2021년 매출 목표 17배 증가\n- 2021년 1월 : 유픽 어플리케이션 출시",
