         "positionInfo": "[Building a Better Healthcare Experience]\n우리의 IT 기술로 세상에 꼭 필요한 헬스케어 플랫폼을 만듭니다.\nㆍ세나클소프트는 의사와 개인 간 양방향 \"헬스케어 서비스\"를 지향하는 디지털 헬스케어 기업입니다.\n다양한 의료인, 환자와 보호자, 생활 속에서 미리 건강을 챙기고 싶은 우리 모두의 경험을 새로운 시각으로 해석해 더 나은 헬스케어 서비스를 만드는 것이 우리의 비전입니다.\n헬스케어는 지금도 매우 중요한 서비스이고, 앞으로 더욱 더 우리에게 필수적인 서비스가 될 것입니다.\n기존의 단편적이고 파편화된 헬스케어 서비스가 아니라 아직 세상에 없는, 새롭고 완결적인 헬스케어 플랫폼을 준비하고 있습니다.\nㆍ세나클소프트에서는 함께 성장할 수 있습니다.\n세나클소프트에는 뛰어난 동료들이 많습니다. SKT,네이버 등에서 모두가 아는 IT 서비스들을 만들고, 성공시켰던 사람들이 모였습니다. 우리는 문제에 집착하여 끝까지 파고들어 해결하며, 높은 완성도를 추구하고 이를 위해 서로의 의견을 자유롭게 나눕니다. 이런 저희와 함께 하신다면 최고의 동료들과 함께 미션과 과제들을 수행하면서 성장하실 수 있으며, 가치 있는 일에 도전하고 성공하는 보람을 느끼실 수 있을 것입니다.\n또한, 세나클소프트는 지금도 빠르게 성장 중입니다. 최근 Series-B 추가 투자 유치로 총 231억원의 투자를 유치하였으며, 대한의사협회와 서울아산병원 등과 전략적 협력을 추진하는 등 의료업계에서 주목을 받고 있습니다.\n빠르게 성장 중인 세나클소프트와 함께 성장하고 싶으신 분이라면 지원해주세요!\n\n﻿[HIstory]\n- 2021.07 카카오벤처스, 뮤렉스, 두나무, 아산사회복지재단 등에서 Series-B 추가 투자 유치 126억 - 누적 투자 231억\n- 2021.01 오름차트(클라우드 SaaS EMR) 출시\n- 2020.12 대한의사협회 EMR 업무 협력 MOU 체결\n- 2020.07 네이버클라우드, 카카오벤처스, 뮤렉스, 두나무 등에서 Series-A 투자 105억\n\n[News]\n'”언제 어디서든 환자 기록 볼 수 있게” 헬스케어 도전' [기사보기]\n‘[기획] ‘EMR’수술하러 온 IT전문가' [기사보기]\n'대한의사협회-세나클소프트 EMR 업무협력 MOU 체결' [기사보기]\n'세나클소프트,클라우드 EMR '오름차트' 첫 선 [기사보기]\n'카카오.두나무가 점찍었다...디지털 헬스케어 '세나클소프트' 126억 투자[기사보기]\n\n[Homepage]\nㆍhttps://www.cenacle.com\nㆍhttps://www.ormchart.com\n\n담당업무\n신규개발중인 헬스케어 서비스와 의료용 SW의 Backend Server 개발 및 운영",
