         "positionInfo": "스캐터랩 핑퐁팀은 AI를 통해 누구나 소중한 관계를 갖는 세상을 꿈꾸고 있어요. 그래서 우리의 비전은 Democratizing High Quality Relationships 입니다. 이러한 비전을 위해 우리는 친근하고 재밌는 자유 대화 경험을 제공하는 딥러닝 기술을 제품화하며, 동시에 무엇이 사람과 좋은 관계를 맺게 하는지에 대한 깊은 고민을 해나가고 있어요.\n최근 AI는 Model-centric에서 Data-centric으로 옮겨가고 있어요. 데이터를 어떻게 정제하고 어떻게 활용할 것인지가 모델의 성능을 결정할 정도로 중요해졌죠. 머신러닝 플랫폼 엔지니어는 데이터 정제부터 모델의 학습과 평가, 배포와 모니터링에 이르기까지 머신러닝 모델이 만들어져서 세상에 나오는 데까지 필요한 여러 형태의 엔지니어링을 담당한답니다.\n이러한 일들을 통틀어 MLOps라고 부르는데요, 이 과정이 잘 만들어져야 연구에서 배포까지의 모든 과정이 빠르고 정확하게 이루어지기 때문에 전세계의 많은 회사들이 집중하고 있는 영역이죠. 핑퐁팀의 머신러닝 플랫폼 엔지니어로 일하면 MLOps의 모든 구성 요소 각각을 깊이 있게 경험해볼 수 있어요. 대규모 비정형 데이터를 정제하고 그걸로 대규모 언어 모델을 학습시키는 과정은 굉장히 까다롭고, 스캐터랩 핑퐁팀에서만 경험할 수 있는 업무죠 :) 또한 '이루다'는 머신러닝 모델이 직접적으로 사용자를 만나는 서비스기에, 대규모 트래픽을 견디는 모델을 배포하며 겪을 수 있는 여러 문제를 만나고 이를 해결해보는 경험을 통해 머신러닝 플랫폼 엔지니어가 크게 성장할 수 있는 밑바탕을 제공합니다. 원대한 목표와 멋진 문화를 공유하는 저희 핑퐁팀에서 함께 루다를 성장시켜 나갈 분을 찾아요 🙋🏻\n주요 업무\n데이터 처리 파이프라인 구축\n\n모델 학습 및 실험을 쉽고 빠르게 수행할 수 있도록 데이터 전처리, 학습, 실험 파이프라인을 개발합니다.\n로그 스트리밍, 대규모 배치 작업 수행 등 다양한 일을 하는 파이프라인을 구축하고 운영에 필요한 도구를 개발합니다.\n\n머신러닝 플랫폼 구축\n\nMLOps 시스템을 자동화 하는데 필요한 마이크로 서비스를 개발하고 운영합니다.\n데이터셋을 잘 관리하고 각 학습 실험 결과를 쉽게 기록하고 비교할 수 있는 실험 추적 시스템을 개발합니다.\n학습된 모델을 저장하고 평가하고 배포하는 모델 레지스트리와 시스템을 개발합니다.",
