         "link": "https://programmers.co.kr/job_positions/7088",
         "positionInfo": "페이타랩은 다양한 프랜차이즈 카페 및 개인 카페 브랜드의 주문을 한 곳에서 할 수 있는 커피주문앱, \n「패스오더」를 만드는 팀이에요!\n패스오더는 자영업 사장님들의 인건비 부담, 매출 부진이라는 문제를 해결하기 위해 세상에 태어났어요.\n우리는 대형 프랜차이즈에서만 가능했던 스마트오더 시스템을 중소형 프랜차이즈 카페 및 개인 카페까지 가능하도록 만들었고, 현재는 자체 오더 시스템을 갖고 있던 대형 프랜차이즈에서도 입점할 만큼 놀라운 속도로 성장하고 있어요!\n\n자신의 분야에서 탁월한 실력을 갖고 있는 동료들이 있었기에 이런 성과를 이뤄낼 수 있었다고 생각해요.\n지금 우리와 함께 패스오더를 만들어 나갈 분을 찾고 있어요!\n\n【저희는 이렇게 일해요!】\n\n1. 완벽한 결과물은 없다고 생각해요. 빠르게 실행해보고 아니면 개선해나가요.\n2. 그냥 하는 일은 없어요. 스스로 업무를 할 때 '왜'를 항상 생각해요.\n3. 하나의 팀으로 서로 단단하게 연결되어 있기 위해 사내의 모든 정보는 투명하게 공유하고 있어요.\n4. 직책 및 연차에 상관없이 모든 구성원이 자유롭게 소통하고 대담하게 피드백을 주고 받아요.\n5. 수평적인 문화를 지향하고 있어요. 직급 대신 모두에게 '님'이라는 호칭을 사용해요.\n6. 업무는 수직적으로 해요. 책임을 지는 의사결정권자와 실무자의 구분을 명확히 해요.\n7. 가족이 아닌 스포츠팀처럼 각자의 포지션에서 최고가 되기 위해 끊임없이 배우고 노력해요.\n8. 구성원들은 서로를 진심으로 아끼고 배려해요. 일은 힘들 수 있지만, 사람때문에 힘든 일은 없어요.\n9. 저녁 회식이 없어요. 다음 날 최상의 컨디션으로 일할 수 있도록 회사가 방해하지 않아요.\n\n[오시면 이런 업무를 맡게 되실 거에요!]\n\nAngular 기반 웹 프론트엔드 개발\nJenkins, Docker, AWS 기반 서비스 배포 및 운영\n운영중인 서비스의 유지보수 및 관리\n\n\n[개발환경]\n\n사용언어: Typescript, JavaScript, HTML, CSS, Sass, Pug\n개발환경 및 도구: Node-js, Angular, Webpack, npm, Git",
