         "positionInfo": "오피지지 내 2개 조직에서 각각 유능한 Laravel Engineer를 모십니다!\n오피지지 내 각 개발 조직은 서로 다른 서비스와 프로덕트를 독립적으로 개발 및 운영하고 있습니다.\n이번 채용 과정에서는 지원자님의 역량, 주요 사용 기술 및 전형 상 평가는 물론, 상호 논의를 기반으로 적합한 조직을 제안 드릴 예정입니다. 지속적으로 회사가 성장하고 사업을 확장해나감에 따라 전형 중에 오픈 된 포지션(조직) 외 추가적인 포지션으로 제안을 드릴 수 있습니다.\n\n• LOL Engineering Cell\nLoL Engineering Cell은 리그오브레전드, 배틀그라운드 등 글로벌 게임의 전적 데이터 및 고도화된 통계 데이터를 전세계 게이머들에 제공하는 메인 서비스를 개발.운영하고 있습니다.\n주로 웹서비스에 필요한 백엔드 시스템의 디자인과 개발을 담당하며, 프로젝트 규모에 따라서 아키텍쳐 구성을 같이 담당하는 경우도 있습니다. 수년 간 쌓여 있는 다양한 유저 데이터를 기반으로 여러 통계 시스템을 개발하고 있으며, 빅데이터 플랫폼을 이용하여 유저 맞춤형 데이터를 제공하기 위해 개인화 추천, 딥러닝, 머신러닝 환경을 만들어 갈 예정입니다.\n\n오피지지 메인 서비스 개발 및 고도화, 운영 업무\n\n\n• Peep Cell\nPeep Cell은 OP.GG 내 신사업 조직으로서, OP.GG 의 사용자 기반과 실무적 노하우 등을 지원받으며 새로운 시도를 하고 있습니다. 게이머들을 포커스로 하여 새롭고 효율적인 커뮤니케이션 방식을 개발하고, 더 뛰어난 게임 경험을 만드는 데 일조하는 것이 목표입니다.\nPeep Cell에서 현재 개발 중인 'PEEP'은 게임플레이나, 바쁜 업무 중과 같은 멀티태스킹 상황에서 팀원 간 소통, 정보교환이 필요할 때 효과적으로 쓸 수 있는 새로운 메신저입니다.\n오버레이 기술을 컨셉으로 하여, 영상/음성통화, 화면 공유, 채팅, 드로잉 등을 화면 위에 원하는 위치와 크기로 띄워 놓고 팀원들과 실시간으로 공유할 수 있습니다. 이를 통해 다른 작업을 하면서도 팀원들의 얼굴을 보거나, 문서, 화면을 공유하는 등 기존에 없던 혁신적인 커뮤니케이션 경험을 제공 할 예정입니다.\n\nMessenger 웹 서비스 관련 백엔드의 Modern PHP 통한 구현\n회원 Sign-up/Sign-in, 데이터베이스 등 웹 서비스 백엔드 구현\n채팅 서버, 음성/영상 통화, 미디어 스트리밍 등의 구현 담당(역량 및 경력을 고려하여 담당)\n\n\n직무 비전\n• MAU 5,500만 트래픽을 활용하여, 수백/수천만명 이상을 목표로 하는 글로벌 서비스의 일원이 될 수 있습니다.\n• 극초기 스타트업보다 안정적인 환경에서, 그만큼 도전적인 업무를 수행합니다. 문제를 푸는 것에만 온전히 집중할 수 있습니다.\n• 국내 유일 Laravel 프리미엄 파트너사로서, 코어프로젝트까지 Laravel을 사용하여 개발하는 경험을 쌓을 수 있습니다.\n• Kubernetes 사용으로 대규모 트래픽을 수용할 수 있는 서버 관리 및 운용 경험을 쌓을 수 있습니다.",
