         "technologyStack": [
           "Spring",
           "Node.js",
           "Java",
           "Docker"
         ],
         "link": "https://programmers.co.kr/job_positions/6607",
         "positionInfo": "클래스101은 '모두가 사랑하는 일을 하며 살 수 있도록'이라는 비전을 가진 팀입니다.\n불과 한 세대 전까지만 해도 '가죽 공예를 하면서 살겠다.' , '뜨게질을 하면서 살겠다' 라고 하면 아무도 믿지 않았습니다.\n혹은 자신이 사랑하는 일을 하고 싶다는 사람들에게 \"그게 돈이 돼?\" ,\"그걸로 어떻게 먹고 살려고해?\" 라는 이야기를 했습니다. 우리는 사람들이 자신이 사랑하는 일을 하면서도 멋지게 살 수 있는 세상을 만들고 싶습니다. 한 명이 '가죽공예를 하면서 살거야\"라고 하면 다른 한 명이 \"그래? 나는 꽃꽂이를 하면서 살거야\"라고 말하는 세상을 꿈꿉니다.\n2018년 3월, 준비물까지 챙겨주는 온라인 클래스 플랫폼을 만들었습니다. 예를 들어서 가죽공예 클래스를 결제했다고 하면, 클래스를 수강하는데 필요한 키트들을 집으로 보내드립니다. 온라인으로 클래스를 들으며 나만의 가죽제품을 만들 수 있습니다. 2021년 7월 초 기준, 약 2,00여개 클래스를 오픈했고 3,400만명의 방문자가 다녀갔습니다. 크리에이터분들이 사랑하는 일을 하실 수 있도록 약 470억원을 정산해드렸습니다.\n취미를 넘어서 커리어, 재테크, B2B등의 다양한 카테고리로 확장하여 온라인 클래스 플랫폼 국내 1등을 차지했습니다. 이 과정에서 좋은 동료들이 함께 하게 되었고,현재 350여명이 모여있습니다.\n우리는 지구 1등 온라인 클래스 플랫폼이 되고 싶습니다. 미국과 일본시장에서 순항 중에 있지만, 다양한 국가의 크리에이터분들과 수강생들(클래스메이트)에게 닿고 싶습니다. 그래서 더 많은 크리에이터분들이 클래스를 열고, 자신이 사랑하는 일을 하면서도 멋지게 살아가는 모습을 보여주고 싶습니다. 그리고 더 많은 클래스메이트들이 클래스를 통해서 꿈꾸기만 했던 자신이 사랑하는 일을 시작할 수 있기를 바랍니다.\n이 목표를 달성하기 위해서 착하고, 똑똑하고, 야망있는 더 많은 착똑야들과 함께 하고 싶습니다. 우리와 함께 세상을 바꿔보는 건 어떨까요? 당신은 착하고 똑똑하고 야망있는 사람인가요?\n\n클래스101의 메인 서비스는 TypeScript 언어 환경에서 React, Mobx, React Native, Apollo, MongoDB을 이용해 개발되었고, 이를 Java/Spring 기반의 MSA 로 전환 중입니다.\n본인의 선호와 기량에 따라 백엔드, 플랫폼, 인프라, DevOps 등 직무를 변경하여 업무를 진행할 수 있습니다.\n각각의 업무 내용은 문서화하여 유연한 업무 환경을 구축하고 있습니다.\n▶︎시리즈 B 유치 관련 뉴스 https://wowtale.net/2021/09/03/class101-raised-series-b-funding/?fbclid=IwAR1GWCkrL540b3Cp--qLreEHqPy76O3BjkEtfbgSWHF0Y01I7kVPibeM5PU\n▶︎ CTO 인터뷰  https://medium.com/class101/class101%EC%9D%B4-%EB%8B%B9%EC%8B%A0%EC%9D%84-%EA%B8%B0%EB%8B%A4%EB%A6%AC%EB%8A%94-%EC%9D%B4%EC%9C%A0-a36cbf9a886\n주요업무\n\n클래스101의 다양한 서비스 설계 및 개발, 운영\n기존 서비스를 마이크로서비스로 전환",
