         "link": "https://programmers.co.kr/job_positions/6578",
         "positionInfo": "하이어엑스 소개\n누구나 원하는 만큼, 원하는 곳에서 새로운 기회를.\n하이어엑스는 일을 바라보는 새로운 관점을 제시하고 관계의 틀을 변화시켜, 보다 자유로운 삶을 살 수 있도록 경쟁력을 제공한다는 미션을 수행하고자 합니다.\n하이어엑스는 누구나 원하는 만큼, 원하는 곳에서 새로운 기회를 펼칠 수 있도록 도전을 함께하며 도전에 필요한 기술, 환경, 플랫폼을 만들어갑니다.\n프로덕트 소개\n\n함께하는 사람들의 TO-DO 공유 플랫폼 '워키도키'\n\nwww.wkdk.kr\n워키도키 주요기능\n#확실한 할 일 공유와 확인으로 신뢰도가 쑥!\n\n\n일일 체크리스트 생성 및 그룹원별 수행도 관리\n카메라 기능을 활용한 '인증샷'으로 공유\n댓글 기능을 통한 의사소통 및 정확한 피드백\n곳곳에 숨어있는 리워드로 재미가 2배!(업데이트 예정)\n\n\n#할 일과 전달사항을 보기 쉽게 한눈에!\n\n\n썸네일형 레이아웃으로 빠른 할 일 파악\n언제든 활용할 수 있도록 한 일 히스토리 영구 보관\n그룹별 폴더 생성 및 친구 초대 등 커스터마이징 활용\n공지사항, 특이사항 등 스팟성 이슈 정리 및 공유\n\n\n#PUSH 알람을 통한 누락 및 '깜빡' 방지!\n\n\n시간별, 그룹별, 그룹원별 개별 지정이 가능한 PUSH 알림\n\n\n워키도키(구 알바체크)가 더 궁금하시다면?\n아래 페이지에서 JTBC 특집 다큐멘터리 방송을!\n안녕하세요, 하이어엑스 입니다.\n2. 24시 무인매장 관리 & 매칭 플랫폼 '브라우니'\nwww.brwnie.kr\n브라우니는 무인 매장에 필요한 관리 업무(머신 및 키오스크 관리, 청소, 재고 관리 등)를 업종별로 표준화하여, 무인 매장을 운영하는 회원들을 대상으로 정기 관리 서비스를 제공합니다.\n무인 매장이지만 주기적으로 관리가 필요해 진정한 무인 매장이 될 수 없었던 기존 시장의 pain point를 해결하고, 우리동네 소식지부터 브라우니로 대변되는 긱워커 매칭을 통한 하이퍼 로컬 플랫폼으로 성장해가고 있습니다.\n하이어엑스 발자취\n\n2018년 12월 '시드 투자 유치'\n2019년 3월 '워키도키(구 알바체크)베타 서비스 출시'\n2019년 6월 '퍼스트펭귄 기업 선정'\n2019년 10월 '디캠프 데모데이 디데이 우승'\n2019년 11월 '교원 딥체인지 스타트업 프라이즈 데모데이 최우수상'\n2019년 12월 '더벤처스 2019 청년기업 엑셀러레이팅 데모데이 1등'\n2019년 12월 '에이벤처스 & 미라클랩으로부터 후속 투자 유치'\n2020년 1월 '디캠프 입주'\n2020년 9월 '워키도키(구 알바체크)정식버전 출시'\n2020년 9월 '신한캐피탈 & 신한금융투자로부터 프리 시리즈A 투자 유치'\n2021년 5월 '위키도키 서비스명 변경'\n2021년 6월 '(주)하이어엑스 사명 변경 (구 (주)알바체크)'\n2021년 6월 '브라우니 MVP 테스트'\n2021년 7월 '브라우니 1.0 beta open'\n\n개발 환경\n\n서버 OS : Linux, 가상화\n주요 언어 : JavaScript (ES6, TypeScript), Java11\n프레임워크 : Express, Koa, Node.js, React Native, Spring Boot\n형상 관리 : Git, AWS Code Deploy\n인프라 : AWS, Docker\n모니터링, 로깅 : Sentry, Firebase Crashlytics\nDB, DW : AWS S3, AWS Redis, AWS PostgreSQL\n개발 도구 : Visual Studio Code, intelliJ\n**개발 환경은 팀 내 논의를 통해 자유롭게 선택, 적용할 수 있습니다.**\n\n담당업무\n백엔드 서버 개발자 (Node.js)\n\n\n서비스 신규 기능 개발 및 유지 보수\n웹, 앱, 어드민 백엔드 설계 및 API 디자인, 개발\n사용자 편의를 위한 서비스 성능 및 품질 개선",
