         "positionInfo": "＜어떤 회사인가요?＞\n• AI(인공지능)에 대해 재미있는 사실이 한 가지 있습니다. 머신러닝(기계학습)을 위해서는 엄청나게 많은 데이터가 필요한데 이 데이터 정제작업을 사람이 제공한다는 것이죠. 지금 이 순간에도 수천 명의 작업자들이 기계학습에 사용될 데이터를 위해 정제작업을 하고 있습니다.\n• 크라우드웍스는 기계학습 데이터를 위한 플랫폼을 제공하고 있습니다. 크라우드웍스 플랫폼에서 작업자들(크라우드웍스 회원)은 데이터 정제작업을 하여 돈을 벌고 AI 서비스 기업들은 원하는 데이터를 얻을 수 있습니다.\n• 네이버, 라인, 카카오, 현대카드, 삼성 등 국내 대부분의 AI 선두기업들은 크라우드웍스의 고객입니다.\n＜크라우드웍스 기업 서비스 소개 영상＞\n• https://www.youtube.com/watch?v=J_7NpRm4cPA&feature=youtu.be\n• https://www.youtube.com/watch?v=rQlIosOhzAk&feature=youtu.be\n• https://www.youtube.com/watch?v=KhH65pPZrOY&feature=youtu.be\n＜백엔드 개발자는?＞\n• 직무소개: 크라우드웍스 플랫폼의 백엔드 영역을 담당합니다.\n기술 기반은 Java입니다. 하지만 기술적인 제약을 두지는 않고, 문제 해결을 위해 최선의 선택을 하려고 노력합니다. 그래서 웹 환경을 구성하는 다양한 요소에 대해 전반적인 이해가 필요합니다.\n• 업무 상 Challenge: 현 시스템에 대한 이해를 바탕으로 확장성과 협업 가능성, 성능을 모두 고려합니다. 다양한 상황에 대응할 수 있도록 기술적인 면 뿐만 아니라 비즈니스 컨셉을 유연하게 설계하며, 토론과 협의를 중요하게 여깁니다.\n• 커리어 성장 요소: 흔한 표현처럼, 우리는 달리는 자동차의 바퀴를 바꾸고 있습니다. 열정적인 개발자라면 이 말에 숨겨진 기회를 이해할 것입니다. 저희 비즈니스는 복잡합니다. 그럼에도 더 다양한 기능과 더 높은 트래픽을 수용할 수 있도록 준비하고 있으며, 그 매력을 지원자 여러분과 함께 경험하고 싶습니다.\n＜백엔드 개발자 포지션 소개 영상＞\n• https://www.youtube.com/watch?v=QQ_FhAR8vu8&feature=youtu.be\n＜채용 절차＞\n크라우드웍스 인재영입 절차는 다음과 같습니다.\n• 채용절차: 서류전형 - 직무면접 - 컬쳐면접 - 처우협의\n• 제출서류: 지원서 & 포트폴리오 (PDF 제출)\n<주요 업무>\n• 플랫폼 백엔드 개발",
