         "link": "https://programmers.co.kr/job_positions/7103",
         "positionInfo": "코코네는 감성이 표현가능한 디지털 어패럴 서비스를 제공하는 글로벌 기업입니다.\n\n코코네는 ‘Shape your feeling Share your feeling’ 이라는 슬로건을 가지고 2008년에 설립되어 현재 서울과 도쿄, 센다이, 교토, 후쿠오카, 중국의 상하이에서 디지털 어패럴 서비스를 제공하고 있으며, 전체 사원수 약 600명, 그 중 코코네 신사옥(논현동)과 GMC(글로벌센터, 종로구)에 약 200여명과 함께 코코네의 성장을 위하여 함께 노력하고 있습니다.\n\n1. 우리가 하고 있는 것은 게임이 아닙니다. CCP(Character Coordinating Play)는 코코네가 독자적으로 완성시킨 장르의 소셜 네트워크 서비스로 감성을 표현할 수 있도록 만들고 꾸미고 어필하고 자랑하고 소통하며 교류하는 디지털 어패럴입니다.\n\n2. 일본을 시작으로 한국과 중국에 거점이 있는 글로벌 기업으로 이것에 멈추지 않고 더 넓은 세계로 서비스를 확장해 갈 예정입니다.\n\n3. 일본, 대만, 미국, 캐나다를 넘어 다양한 국적의 사원과 일하며 소통할 수 있는 업무 환경을 가지고 있습니다.\n\n\n\n●가치관\n코코네라는 이름은 일본어로 마음(Cocoro), 말(Cotoba), 네트워크(Network)의 머리글자에서 유래되었습니다.\n\n서비스가 모여 사람과 사람이 네트워크로 연결되고, 즐거운 리듬감이 생겨나고 있는 상태를 나타냄과 동시에, 우리 코코네의 크루(멤버)가 모여, 행복을 줄 수 있는 좋은 것을 만들고 싶다는 마음이 담겨 있습니다.\n\n●인재상\n[코코네 마인드]\n코코네에서는 함께 일하는 모든 멤버를 ‘크루’라고 합니다. .\n크루란 같은 배를 탄 크루 한 명, 한 명의 힘을 원동력으로 삼아 모두가 바라는 목적지를 향해 함께 돕고 조율하며 나아간다는 의미를 담고 있습니다.\n크루의 성장이 곧 코코네의 성장이고, 한명의 크루가 하나의 코코네로 성장하기 위하여 우리는 12가지의 약속을 만들고 실행하고 있습니다.\n\n1 고객이 원하는 가치를 만듭니다.\n2 어제의 나보다 발전합니다.\n3 팀으로 일하고 발전합니다.\n4 새로운 생각을 두려워하지 않습니다.\n5 업무 개선에 참여합니다.\n6 스스로 돌아보고 개선합니다.\n7 유연하게 행동합니다.\n8 적극적으로 소통합니다.\n9 생각은 깊게, 전달은 간결하게\n10 서로를 존중하고 공감합니다.\n11 객관적으로 생각하고 행동합니다.\n12 비판이 아닌 다른의견으로 이해합니다.\n\n●조직문화\n\n-컴퍼니 문화\n우리는 회사라는 큰 틀안에서 각각의 팀을 하나의 컴퍼니로 규정하여 업무를 수행하는 컴퍼니 제도를 가지고 있습니다.\n최고의 효율과 목표달성을 위하여 목표에 집중 할 수 있도록 컴퍼니에 자율성을 부여하고 일하는 방식, 출퇴근 시간을 자유롭게 조정하는 합리적인 의사 결정권을 가지고 있습니다.\n\n-수평문화\n누구나 평등하고 자유롭게 자신의 의견을 내고, 또 스스로 결정 할 수 있습니다.\n\n코코네의 일하는 분위기가 궁금하다면?\n인스타 그램 @cocone_seoul\n페이스북 https://www.facebook.com/coconekr\n\n유튜브 스타 '대도서관+마리킴' 과 함께한 코코네 서비스 영상 보기\nhttps://www.youtube.com/watch?v=OCfSxJVt0Es\n코코네는 디지털 공간 속 캐릭터(아바타)를 꾸미고 그 안에서 만나는 사람들과 함께 감성을 교류할 수 있는 서비스를 제공해왔습니다. 코코네는 이러한 서비스의 장르를 CCP(Character Coordinating Play)라고 정의하고, 디지털 속에서 사람들이 감정을 향유할 수 있는 코코네만의 독자적인 메타버스 세상을 선보여왔습니다.\n\n안국동에 위치한 코코네 글로벌 경영기획 센터의 Metaverse 팀은 지난 10여년간 쌓아온 코코네만의 CCP 서비스 노하우를 바탕으로, 이번에는 3D 이미지를 활용한 또다른 메타버스 세상을 만들고자 모인 팀입니다. 3D 아바타를 통하여 어떤 제약도 없이 무한히 자유로운 경험과 다양한 사람들을 만날 수 있는 근사한 세상을 상상해보세요! 이 세상은 현실세계와 가상세계를 하나로 연결하는 공간일 것입니다. 이 상상에 가슴이 두근거리며 메타버스 세상을 건설해나갈 도전에 함께 해주실 멋진 크루를 기다립니다!\n\n[이런 동료를 원해요!]\n1.내가 하는 일이 어떤 서비스를 만들어 나가는지 이해하고 그것을 즐길 줄 아는 분\n2.최신 기술과 트렌드를 연구, 흡수하고 그것을 업무에 활용할 수있는 분\n3.더 나은 프로가 되기 위해 끊임없이 고민하고 적극적으로 실행하시는 분\n4.직군과 관계없이 어울릴 수 있고, 적극적인 커뮤니케이션을 하려고 노력하는 분\n5.본인이 맡은 업무에 책임감을 갖고 마무리 하시는 분\n＜채용 프로세스＞\n서류전형 → AI역량검사 → 1차면접(실무진) → 2차면접(인사팀/임원진) → 처우협의 → 최종합격\n\n[업무내용]\n• 메타버스 서비스 및 신규 서비스의 서버 파트 설계 및 신규 개발 담당\n• 현재 운영중인 CCP 서비스의 신규 기능을 추가하기 위해서 서버 파트 개발 담당\n• 고객 정보를 관리하는 CMS를 개발\n• 기존에 진행하는 이벤트를 주기적으로 진행하기 위해서 DB 데이터 입력,수정 작업등을 수행하며, 더 나은 이벤트를 제공하기 위해서 서버 로직 수정 작업 진행\n• 서비스 상태를 모니터링 하고 분석하여 더 나은 서비스를 제공하기 위한 방안을 제시하고 수정&보완",
