         "positionInfo": "CAN(Community Alliance Network)은 커뮤니티 기반 비즈니스의 새로운 패러다임을 열 수 있는 SaaS(Software as a Service) 플랫폼으로, viki.com 과 vingle 을 창업하여 성공적인 커뮤니티 비즈니스를 이끌었고, 커뮤니티 혁신을 시도하는 수많은 초기 기업에 투자해 온 문지원 대표, 호창성 대표의 새로운 Project입니다.\n 대부분의 창업자들은 자체 개발팀을 보유할 여건이 되지 않거나, 자체 개발을 한다 할지라도 비용 효율을 최적화하기 힘듭니다. 많은 창업자들은 또한 Shopify, Wordpress, Webflow, Wix 등의 SaaS 솔루션을 이용해 보지만 이러한 솔루션으로 할 수 있는 서비스의 한계는 명확합니다. 단순 쇼핑몰이나 콘텐츠 디스플레이를 넘어 강력한 소셜 및 커뮤니티 기능을 갖춘 온라인 플랫폼을 구축할 수 없으며, 커스터마이징의 한계로 자신만의 독창적인 기능과 비즈니스 모델을 추구하기 힘듭니다. \n \nCAN은 초기 고객들(온라인 플랫폼을 구축하는 창업자들)로부터 “만족도 최고\"의 찬사를 얻고 있습니다. CAN이 인하우스 개발팀이 없이도 자체 개발에 준하는 효과를 위한 궁극적 대안을 제공하기 때문입니다.\nCAN SaaS는 강력한 커뮤니티 기능들과 콘텐츠, 커머스가 유기적으로 결합된 서비스를 가능하게 함으로써 다양한 혁신적인 창업 모델을 지원하려 합니다. Discord와 같은 채널 커뮤니케이션, 포럼, 실시간 메시징, 다자간 비디오 채팅, 소모임 관리, 고도로 커스터마이징 가능한 사용자 레벨, 사용자 권한 및 로열티 프로그램 설계, 배지 시스템, 크라우드 펀딩, 공동구매, 콘텐츠 구독, 기능 구독, 커뮤니티 토큰 및 NFT 지원등 다양한 모듈을 레고 블럭처럼 조합하여 서비스를 만들 수 있도록 할 예정입니다. 또한, CAN에 존재하지 않는 기능 또한 플러그인으로 개발하여 통합할 수 있는 환경을 제공하여, 커스터마이징의 자유도를 극대화 할 수 있도록 CAN SaaS 구조를 설계하고 있습니다. \nCAN의 Product & Engineering 팀에 Join 하세요. \n\n\n훌륭한 창업자들의 비즈니스 성장이 곧 우리의 성장이 됩니다.\n구현된 기술들이 다양하게 적용되어 독창적인 비즈니스 모델로 운영되는 것을 지켜보는 희열이 있습니다.\n한국만이 아니라 영어권을 타깃으로 하는 글로벌 서비스인 만큼, 글로벌 서비스 개발 역량을 키울 수 있습니다.\n미국, 한국, 베트남, 싱가포르 팀과의 협업을 포함하여 다양한 국가, 다양한 비즈니스 영역의 전문가들과 협업을 경험할 수 있습니다.\n커머스, 커뮤니티, 블록체인, 배지 등 다양한 Product와 기술들을 다루어 볼 수 있습니다.\n\n\n* CAN 소개 링크: https://communityalliance.network/ \n* CAN ‘캐노베이트 2021' : https://platum.kr/archives/164192\n────────────────────────────────────────\n빙글 Backend팀의 궁극적인 업무 목표는 더 좋은 서비스를 만드는 것입니다.\n빙글에서 저희 팀이 가장 잘 할수 있으며, 빙글 서비스에 도움이 되는 일이라면 모두 저희의 일의 일부입니다. 따라서, 저희는 아래와 같은 가치들을 중요하게 생각하며, 이러한 가치들에 마음속 깊이 동의하시는 분들을 찾습니다\n．\n\nSoftware를 만드는 일은 즐겁습니다.\n\"다들 이렇게 하니까\" 는 올바른 설득 논리가 아닙니다.\nLanguage, Framework, Library는 도구에 불과하며, 개발자라면 새롭고 올바른 도구를 찾는데 전혀 거부감이 없어야 합니다.\n자신이나 팀원들의 작업물에 대해, 직설적이고 분명하게 피드백을 주고 토론할수 있어야 합니다. 예의바르게 돌려 말하는건 개발자의 미덕이 아닙니다.\n독립된 시스템을 처음부터 끝까지 올바르게 설계하고 구현할 수 있어야만 Senior Developer라고 불릴수 있는 자격이 있습니다.\n\n．\n저희 팀에서 중요하게 생각하는 원칙들은 여기서 더 자세히 찾아보실수 있습니다\nEnglish, 한국어\n．\n．\n🖥업무 내용\n────────────────────────────────────────\n\n프로덕션 서비스 운영\n사용자 데이터 수집, 처리 및 가공\nCommunity Governance를 위한 기능 개발\n다양한 Content Recommendation / Curation System 개발\n새로운 Content Format(Talk, Q&A등) 과 새로운 Media(Video, GIF등) 개발\n관심사 기반 SNS 빙글 클라이언트를 위한 AWS Lambda, Typescript 기반의 API 개발",
