         "link": "https://programmers.co.kr/job_positions/7039",
         "positionInfo": "\"우리는 모든 경험을 연결하여 여행을 혁신합니다.\"\n마이리얼트립은 고객과 데이터를 중심의 최고의 여행 서비스를 개발합니다. 전 세계의 항공, 숙박, 교통, 투어&액티비티 상품들을 효과적으로 관리하고, 서로 다른 상품들의 경험을 통일하여 쉽고, 편리한 탐색/예약/구매 경험을 제공하기 위해 노력합니다. 최고 수준의 기술로 기존에 존재하지 않는 새로운 여행 경험을 제시하고자 합니다.\nRuby On Rails 백엔드 개발자는 현재 마이리얼트립 서비스의 근간이 되는 Ruby On Rails 기반의 플랫폼에 대한 백엔드 개발을 담당하면서, 다양한 팀들과 협업하며 고객이 겪고 있는 문제를 해결하기 위해 노력합니다. 파트너가 상품을 등록/관리하고 여행자가 상품을 조회/예약하는 것부터 운영자가 정산/송금하는 것에 이르기까지 온라인 플랫폼 전반을 두루 경험할 수 있습니다. 마이리얼트립은 현재 Java/Kotlin 기반 신규 플랫폼으로 전환 중에 있습니다. 그래서 Ruby 개발자이면서도 Java/Kotlin 개발자로의 성장을 기대하고 독려합니다.\n🕵️‍♂️ 마이리얼트립 제품 개발 조직은 이렇게 일합니다.\n👉 데이터를 기반으로 고객에게 최상의 임팩트를 제공하기 위해 모든 구성원이 함께 치열하게 고민합니다. 데이터를 기반으로 문제를 정의하고, 제품/사업/운영 조직이 함께 해결책을 모색합니다. 모든 조직이 최상의 결과물을 얻기 위해 치열하게 도전합니다.\n👉 고객의 소리에 집중합니다. 우리가 고객이 가지고 있는 문제에 집중하며, 그 문제를 단순히 풀어내는 것이 아니라, 10배, 100배 더 잘 풀어내기 위해 끊임없이 고민합니다.\n👉 상호존중과 신뢰를 기반으로 함께 성장합니다. 우리팀은 나이/연차와 무관한 강한 책임감을 가지고 각자 맡은 업무를 주도적으로 진행하며, 동료들과 더 나은 서비스를 위하여 자유롭게 의견을 개진합니다. 그리고 경쟁이 아닌 함께 성장하는 문화를 만들어가고자 합니다.\n💡 마이리얼트립 프로덕트 조직, Experience 개발팀의 일하는 방식과 문화에 대해 더 자세히 참고하실 수 있습니다.\n\n\n우리는 Experience 개발팀입니다 - 1편 (우리가 해야만 하는 것)\n우리는 Experience 개발팀입니다 - 2편 (우리가 되고자 하는 것)\nRetrofit2 와 Resilience4j 를 이용한 빠른 Rest API Client 구현\n도메인 주도 설계로 소프트웨어 만들기\n\n\n[담당업무]\n\nRuby on Rails 기반 플랫폼의 백엔드 개발\n여행자 페이지에서부터 내부 운영자들을 위한 매니저 페이지에 이르기까지 플랫폼 전반의 개발 담당\n다양한 API를 제공을 통한 프론트엔드팀, 모바일팀 지원",
