         "positionInfo": "로그프레소는 2013년 빅데이터 기반 의사결정 자동화를 미션으로 설립된 회사입니다.\n회사 설립 이전인 2009년부터 10년 이상 빅데이터 기술을 연구 개발하였고, 이를 기반으로 사이버 보안, IT 운영관리, 이상거래탐지, 제조공정 최적화, 실시간 마케팅 캠페인 등 다양한 분야에 솔루션을 제공하고 있습니다.\n\n로그프레소 엔진팀은 오픈소스 라이브러리를 조립하는게 아닌 데이터베이스 엔진 자체를 개발하는 팀입니다. 로그프레소는 OLAP과 OLTP를 모두 아우를 수 있는 완전한 미션 크리티컬 엔터프라이즈 데이터 플랫폼을 만드는 것을 목표로 장기간 엔진 기술에 투자하고 있습니다.\n\n전통적인 데이터베이스 기술은 오픈소스, 일상재가 되어가고 있지만 5G로 촉발될 IoT 데이터의 폭발적 증가, 그리고 클라우드와 AI 기술의 발전은 새로운 도전을 요구하고 있습니다.\n\n로그프레소는 기존에 ETL/CDC, 데이터 웨어하우스, 데이터마트, BI/OLAP 툴로 분리되어 있던 데이터 파이프라인을 자체 원천 기술로 수직적 통합하여 성능을 극대화하고 복잡한 데이터 플랫폼 운영을 극도로 단순화하여 제공합니다.\n\n글로벌 솔루션과 견주어도 우수한 기능과 성능의 빅데이터 플랫폼을 함께 도전하여 만들어가실 분을 모십니다.\n주요 업무\n\n데이터베이스 엔진 개발: 쿼리, 스토리지, 인덱스, 복제, 스트림 및 CEP 엔진\n쿼리 등 리그레션 테스트 개발",
