         "positionInfo": "[직무소개]\n🙋🏻‍♂️마이리얼트립의 Senior Technical QA Engineer는 마이리얼트립의 서비스를 구성하는 모든 부분의 시작부터 끝까지 품질을 책임집니다. 다양한 QA 활동의 결과를 분석하여 개발 프로세스를 개선하고, 테크니컬 기반의 QA를 위해 자동화 테스트 및 정적 테스트 등도 적극적으로 도입하여 불필요한 리소스를 줄이고 더 높은 서비스 안정성을 확보할 수 있도록 합니다.\n마이리얼트립은 세상의 모든 여행 경험을 연결함으로써 여행을 혁신하고자 합니다. 고객의 기대를 넘어, 누구도 경험하지 못한 새로운 여행 서비스를 제공하기 위하여 우리는 품질에 집착합니다. MSA(Micro Services Architecture) 환경에서 수많은 서비스들이 빠르게 개발되고 배포되지만, 기술로써 서비스의 변화와 복잡성을 관리하고자 합니다. 우리는 사람의 노력이 아닌 기술과 프로세스의 개선을 통해 높은 수준의 서비스 퀄리티를 보장합니다. 세상 누구도 가보지 않은 QA 영역을 함께 만들어가고 싶은 뛰어난 QA Engineer분들의 도전을 기대합니다.\n\n[팀 소개]\nTQA팀은 이렇게 일합니다.\n🙆🏻팀원 각자가 책임감을 가질 수 있도록 한개 이상의 프로젝트를 리딩하여 QA 활동을 수행하게 됩니다.\n💪🏼TQA팀은 개발직군으로 분류되며, 다른 개발자들과 직접 소통하여 더 나은 품질의 프로젝트가 완성될 수 있도록 긴밀히 협업합니다. 개발실 내에서도 QA를 위해 지원을 아끼지 않으며, 서비스 배포의 최종 권한도 TQA팀에 있습니다.\n📝마이리얼트립 프로덕트 조직의 일하는 방식과 문화에 대해서는 아래 블로그에서 더 자세히 참고하실 수 있습니다.\n\n마이리얼트립 Product Team Blog\n[Job터뷰: C-Level]기술을 통해 여행 시장을 혁신하는 마이리얼트립의 경영진\n\n\n👦 팀원 미니 인터뷰 - 한**님\nTQA팀은 마이리얼트립의 서비스가 최적의 성능으로 동작하고, 최고의 사용자 경험을 제공할 수 있도록 끊임없이 고민합니다. 또한 단순한 기능/비기능적 테스트를 넘어 이상 현상에 대한 모니터링뿐만 아니라 예외적인 부분까지 놓치지 않도록 지속적인 품질 개선 활동에 집중합니다. 내부의 PO, 개발자 그리고 마이리얼트립의 고객 모두를 고려하여 효율적인 테스트 플랜을 설계하고, 좋은 품질을 제공하기 위해 보이지 않는 곳에서 최선을 다하는 사람들로 구성된 팀이라고 자부합니다.\n\n[담당업무]\n\nQA 조직 셋업 및 지속 가능한 조직 문화 구축\nQA 조직의 비전/목표를 설정하고, 구성원들의 성장 지원\n마이리얼트립의 Quality Assurance 정책 수립과 프로세스 확립\n전사 서비스의 품질을 보장하기 위한 테스트 계획 수립, 테스트 수행 및 모니터링에 이르는 Service Release Process 구축 및 개선\n장애에 대한 정의, 대응 프로세스 확립, 재발 방지를 위한 대책 수립과 진행사항 관리\n더 나은 품질과 서비스를 제공하기 위하여 테스트 환경 설계 및 구축\n자동화 테스트 방안 수립 및 자동화 테스트 커버리지 확대",
