         "positionInfo": "[팀 소개]\n디지털서비스팀은 패스트파이브의 온라인 서비스를 가꾸고 있습니다. 공간을 기반으로 한 오프라인 경험을 넘어 고객과 구성원들에게 탁월한 온라인 경험을 제공하는 것을 목표로 합니다.\n현재 패스트파이브 멤버가 이용할 수 있는 모바일앱과 커뮤니티 매니저 등 패스트파이브 내부 직원이 활용하는 관리자 웹앱을 운영하고 있습니다.\n모바일 앱은 다양한 공용 공간을 편리하게 이용할 수 있도록 돕고, 베네핏과 커뮤니티 이벤트 등 공간 이외의 서비스 접근성을 향상시키며, 멤버 사이의 상호 교류를 활성화시켜 네트워크 형성에 기여합니다. 관리자 웹앱은 멤버 획득과 관리, CRM 활동을 위한 커뮤니케이션 채널 일원화 등의 기능을 제공합니다. 이 외에도 멤버들을 위한 웹앱 및 공간서비스 활용을 위한 IoT 기능 등을 개발 중에 있습니다.\n[디지털서비스팀 구성원 인터뷰]\n\n\"항상 '옳은 방향'으로 갈 수 있도록 토론하는 곳\" - 개발자 Kei님 인터뷰\n\nhttps://brunch.co.kr/@fastfive/134\n\n\"시장이 빠르게 바뀌어서 기본을 지키기 쉽지 않죠\" - 프로덕트 매니저 박예원님 인터뷰\n\nhttps://brunch.co.kr/@fastfive/109\n[주요업무]\n\n지속적인 시스템 개선\n\n패파 온라인 서비스들의 백엔드에 지속적인 기능 개발 및 개선을 합니다. 이 과정에서 기획, 디자인, QA 등 동료들과 협업하여 최선의 방안을 찾아 구현합니다.\n\n\n모니터링 및 자동화\n\n운영중인 서비스가 문제없이 잘 동작하는지 상시로 확인하고, 오류가 있을 경우 빠르게 해결합니다. 그리고 반복적으로 발생하는 수작업이 있을 때 자동화하여 업무 효율을 높입니다.\n\n\n코드 리뷰\n\n버그를 줄이고, 코드 품질을 향상시키기 위해 pull request 방식으로 코드 리뷰를 진행합니다.",
