         "positionInfo": "고객사의 디지털 마케팅을 성공으로 이끄는 Tech-Partner로 성장할 Solutions Architect를 찾아요!\n\n솔루션 아키텍트는 모바일 개발 전문지식을 바탕으로 탄탄한 기술 세팅을 지원하고 고객과 가장 가까운 곳에서 비즈니스 성장을 위한 성공 전략을 제공하는 중요한 역할을 담당합니다.\n**지원 시, Solutions Architect 사전질문지를 작성하여 꼭 제출해주세요!**\n주요 업무\n\n고객사 비즈니스 목표, 기술적 니즈 분석을 통한 솔루션 세팅 설계\n솔루션 도입과 활용 단계 전반의 Technical Advisor 역할 수행\nCustomer Success Manager와 협업을 통한 고객사 기술적 이슈 트러블슈팅\nMar-tech SaaS 솔루션(Airbridge, Braze, Amplitude 등)의 기술적 전문가로 밋업 등 외부 행사 참여\n\n에이비일팔공의 Solutions Architect는요,\n\n유니콘부터 대기업까지, 탑티어 고객사의 비즈니스 성공을 위한 Tech-Partner로 성장\n에이비일팔공 Solutions Architect는 고객사의 비즈니스 KPI부터 솔루션 사용을 위한 기술적 니즈 등, 다양한 내용을 복합적으로 분석하고, 고객사가 마케팅 SaaS를 사용하여 성공적인 마케팅 활동을 이어갈 수 있도록, 솔루션 사용 여정의 Technical Partner로서 함께합니다.\n솔루션 도입 단계에서는 SDK 설치법과 제품 사용법에 대한 교육 등의 온보딩 세션을 진행하고, 제품 사용 과정에서 Customer Success Manager, 내부 개발자, 고객사 개발팀 등 다양한 채널과의 협업을 통해 고객이 마주하는 다양한 기술적 문제를 해결합니다.\n비즈니스/기술적 성공 사례 리서치 및 스터디를 통한 인사이트 구축\n전 세계 비즈니스 케이스와 새로운 기술 도구 등에 대한 리서치, 스터디 등을 진행합니다. 이를 통해 얻은 인사이트를 바탕으로 고객사 비즈니스와의 시너지를 창출할 수 있는 방향으로 제품 발전을 지원하고, 실제 고객사에 적용할 수 있도록 도우며 함께 성장합니다.\n전세계가 주목하는 Mar-Tech와 SaaS 솔루션 전문가로 성장\n글로벌 마케팅 업계는 가파르게 성장하고 있으며, 디지털 트랜스포메이션 또한 빠르게 이루어지고 있습니다. 에이비일팔공 Solutions Architect는 전 세계의 주목을 받는 마케팅 SaaS 솔루션인 Amplitude, Braze, Airbridge 등을 사용하고 스터디하며 Mar-Tech와 SaaS 솔루션 전문가로 성장합니다. 뿐만 아니라 Apptimize, Segment, Snowflake 등 신규 마테크 솔루션에 대한 사용법 및 전문지식을 습득할 수 있습니다.",
