         "link": "https://programmers.co.kr/job_positions/6599",
         "positionInfo": "< 주요 업무 >\n• VTOV 수도권 당일배송 택배 시스템의 코어 엔진 개발\n• 구획, 거점, 차량, 기사 등의 운영 최적화 알고리즘 개발\n• 시뮬레이션 단계의 인프라 설계 및 비즈니스 로직 구현\n• 시뮬레이션 단계 이후 필드 테스트 및 Pilot 단계의 택배 시스템 개발\n\n< 지원 분야 >\n• SW Development Engineer는 당분간 지원 분야에 대한 제한이 없습니다.\n• 프로덕션 레벨의 개발에 들어가기 전까지는 팀의 전 인원이 전체적인 흐름을 파악하고 유기적으로 구성될 시스템의 비지니스 로직에 대한 정확한 이해를 하는데 주력하게 됩니다.\n• 이 과정에서 시스템의 인프라 및 DB 설계, 최적화를 위한 알고리즘 연구 및 구현이 주요 업무가 될 것입니다.\n• 특정 파트의 전문적인 지식보다는 팀원들과의 원활한 소통, 작은 단위의 개발 및 문서화가 더 필요한 상황입니다.\n• 시뮬레이션 단계 이후 실제 프로덕트 개발이 진행됨에 따라 인프라, 백엔드, 프론트엔드, 앱 개발 등 전문 분야에 대한 업무로의 전환이 이루어질 예정입니다만, 현 시점에서의 핵심은 부분이 아닌 전체를 보는 관점에서의 개발을 지향한다는 것 입니다.\n• Full-Stack 및 Back-End, Front-End, Android, iOS 개발자는 물론 수학적 모델링, Data Engineering, Data Analytics에 자신있으신 분들도 지원해 주십시오.\n\n< 기술 스택 >\n• 앞서 말씀드린대로 아직 VTOV는 실제 프로덕션 레벨의 개발 과정에 진입하지 않았습니다.\n• 현재 소수의 인원으로 시뮬레이션 단계의 개발을 하고 있고 python과 node를 기반으로 이를 시각화하고 분석하는데 역량을 집중하고 있지만 프로덕션 레벨의 개발 스택에 대해서는 미정입니다.\n• 향후 하나의 서비스를 구성하기 위해 다양한 파트의 개발자분들이 합류하게 되면, 각 분야에 맞는 스택을 정의하고 발전시킬 예정입니다.\n• 현재 단계에서는 미리 정의된 스택에 대한 경험과 노하우가 있는 분을 찾는 대신, 시뮬레이션 과정을 함께하며, 어떤 언어/프레임워크/라이브러리가 가장 효율적일 것인가를 논의하고, 기술 스택을 선정해 나가는 것을 목표로 할 분들을 찾고 있습니다.\n• 기술은 하루가 다르게 발전하고 있기 때문에 어떤 스택이 저희 개발 조직의 생산성과 서비스 성능에 좋은 영향을 미칠 것인지, 그리고 팀원들의 러닝 커브와 확장성을 고려할 때 어떤 스택을 쌓아나가야 하는지 등을 함께 공부하고 논의해서 결정할 수 있는 자유로운 개발 문화를 선호합니다.",
