         "positionInfo": "▶︎ 비팩토리는 어떤 회사인가요?\n비팩토리는 IT 기술로 누구나 화장품을 만들 수 있는 혁신 경험을 제공하여 뷰티의 새로운 패러다임을 그려내는 회사입니다.\n글로벌 뷰티그룹 [COSMAX], 신세계 그룹이 만든 벤처 캐피탈 [시그나이트], 크래프톤∙쏘카∙직방 스타트업 신화를 만든 투자사 [스톤브릿지]에게 기술력과 혁신성을 인정받아 투자 유치에 성공했어요.\n▶︎ 비팩토리는 무슨 일을 하나요?\n\n고객이 원하는 화장품을 직접 구성하여 맞춤형 화장품을 만들 수 있는 서비스와\n진정한 맞춤 화장품 생산이 가능한 스마트 팩토리를 함께 만들어 갑니다\n\n▶ 비팩토리는 어떤 팀인가요?\nGoogle, NAVER, LINE, Dr.Jart에서 제품 개발한 엔지니어, 디자이너, 뷰티 디렉터로 꾸려진 팀이에요.\n이제 막 태어난 팀이지만 책임감과 믿음을 기본으로 구성원과 함께 기업 문화를 만들어 나가고 싶습니다.\n어렵고 힘든 여정이지만 우리의 꿈을 위해 함께 헤쳐나갈 핵심 멤버를 기다리고 있어요.\n▶︎ 비팩토리는 일에 있어 무엇을 가장 중요하게 생각하나요?\n비팩토리는 자율, 책임 그리고 공유를 강조합니다. 회사 그리고 팀의 미션 아래 스스로 일의 범위와 방향을 설정하여 권한을 갖고 진행합니다. 또한 스스로의 결정에 확신과 책임감을 갖고 최고의 품질과 성과를 내기위해 노력합니다. 결과는 모든 구성원들과 투명하게 공유하며 미진한 부분은 시스템적으로 보완하기 위해 노력 합니다.\n빠른 적용과 고객의 피드백을 최우선으로 합니다. 지금 이 순간 우리에게 가장 중요한 것은 완벽보다는 속도와 고객 피드백을 통한 개선입니다. 우리의 생각을 빠르게 구체화하여 고객에게 선보이며 어떻게 고객의 평가를 효과적으로 이끌어 낼 수 있을지 고민하며 평가를 기반으로 서비스를 수정, 개선합니다.\n▶︎ 비팩토리 개발팀의 리더는 어떤 사람인가요?\n개발팀은 스타트업에서만 12년 이상 개발 경험을 갖고 있는 CTO와 수천만이 사용하는 글로벌 서비스를 초기부터 개발 운영한 경험이 있는 Head of Software Engineering 리더쉽을 중심으로 협업합니다.\n개발자로서의 이상과 기술적 완성도, 저희 리더쉽도 무척이나 바라지만 비팩토리에서는 고객을 최우선으로 바라보고 있으며, 고객이 좋아하는 것이 우선 되어야 한다고 생각해요. 우리는 고객의 관점에서 바라보고 이해하며 제품에 우아하게 담아 낼 수 있는 멤버를 찾고 있습니다.\n그렇다고 해서 기술적인 완성도를 무시한다는 이야기는 아니에요. 언제나 기술적 완성도를 위해 부단히 노력합니다. 다만 '이상적인 완성도'와 '현실적 선택'을 항상 오가며 유연하게 선택하여 최고의 고객 경험을 같이 만들어 나가기 위해 노력합니다.\n▶︎ 비팩토리 대표는 누구인가요?\n아시아 최초로 구글에 회사를 매각한 연쇄 창업가 노정석님 입니다.\n자세한 내용은 인터뷰 영상을 참고해주세요.\n[EP03_노정석] 사업은 이렇게 하는 겁니다\n▶︎ 누적 투자 40억, 비팩토리와 함께 혁신을 그려가는 든든한 파트너스\n\n코스맥스 (글로벌 No.1 OEM/ODM 뷰티 그룹)\n시그나이트 (신세계 그룹이 만든 라이프스타일 벤처 캐피탈)\n스톤브릿지 (쏘카, 직방, 지그재그 등 신성장 산업의 유망 기업 투자)\nPKSHA (아시아 AI 전문 투자 및 지원)\n\n▶︎ 제출서류\n(가능하다면) 직접 작성한 코드를 공유 할 수 있는 링크\n이력서 접수 후, 1주일 이내로 면접 진행 여부를 알려드립니다\n면접은 코딩 테스트를 포함하여 1~2회 진행합니다",
