         "link": "https://programmers.co.kr/job_positions/3696",
         "positionInfo": "🚀 마이리얼트립 슈퍼채용\n\nhttps://super-recruit.myrealtrip.com/\n\n\n[직무소개]\n👨‍🏫 마이리얼트립이 만들어가는 항공 서비스\n👉우리가 지금까지 경험한 항공 탐색/예약 경험, 그 너머의 새로운 항공 탐색/예약 경험을 꿈 꿉니다.\n지금까지 우리가 경험한 항공 서비스가 아닌 지금까지 세상에 존재하지 않은 새로운 항공 서비스를 개발하고자 합니다. 당신의 원하는 최적의 여행 목적지를 추천하며, 그 여정을 위한 최적의 항공 탐색/예약 경험을 제공하고자 합니다.\n👉 느리고 답답한 항공 서비스의 한계를 넘어, top-class 수준의 기술을 기반으로 최상의 고객 경험을 제공하기 위해 노력합니다.\n우리는 항공 탐색을 위해 매번 수십초를 대기했습니다. 우리가 왜 이런 불편함을 계속 감수해야만 할까요? 우리는 이런 불편함과 기술적인 해결에 집중합니다. 새로운 기술과 혁신으로 지금까지 당연시했던 불편을 제거하고자 합니다. 오직 고객의 소리, 고객의 경험에 집중하는 서비스를 만들고자 합니다. 이런 서비스를 개발하는 여정에 초대합니다.\n👉 지금까지의 수많은 매뉴얼 작업, 사람으로 관리되는 시스템이 아닌 자동화를 지향합니다.\n지금까지 수많은 사람의 노력에 의해 완성되는 항공 운영 서비스가 아닌 최상의 고객 경험을 제공하기 위하여 모든 예약/취소/환불 프로세스를 자동화하고자 합니다. 우리는 비효율에 집중합니다. 또한 이러한 비효율 극복할 수 있는 기술에 집중하고자 합니다. 해당 기술을 통해 고객뿐만 아니라 함께 일하는 항공 서비스 운영 담당자의 업무 효율 역시 높아질 것을 기대합니다.\n[팀 소개]\n🕵️‍♂️마이리얼트립 항공 개발 조직은 이렇게 일합니다.\n토파스의 항공 서비스 기반 위에서 마이리얼트립의 항공 서비스를 고객에게 제공하고 있습니다. 우리는 현재 시스템에 얻은 경험을 기반으로 세상에 존재하지 않는 새로운 항공 서비스를 개발하고자 합니다.\n👉 데이터를 기반으로 고객에게 최상의 임팩트를 제공하기 위해 모든 구성원이 함께 치열하게 고민합니다. 데이터를 기반으로 문제를 정의하고, 항공 PO/개발자/사업/운영 조직이 함께 해결책을 모색합니다. 모든 조직이 최상의 결과물을 얻기 위해 치열하게 도전합니다.\n👉 고객의 소리에 집중합니다. 우리가 고객이 가지고 있는 문제에 집중하며, 그 문제를 단순히 풀어내는 것이 아니라, 10배, 100배 더 잘 풀어내기 위해 끊임없이 고민합니다.\n👉 상호존중과 신뢰를 기반으로 함께 성장합니다. 우리팀은 나이/연차와 무관한 강한 책임감을 가지고 각자 맡은 업무를 주도적으로 진행하며, 동료들과 더 나은 서비스를 위하여 자유롭게 의견을 개진합니다. 그리고 경쟁이 아닌 함께 성장하는 문화를 만들어가고자 합니다.\n📝 마이리얼트립 프로덕트 조직의 일하는 방식과 문화에 대해서는 아래 블로그에서 더 자세히 참고하실 수 있습니다.\n\n마이리얼트립 Product Team Blog\n[Job터뷰: C-Level]기술을 통해 여행 시장을 혁신하는 마이리얼트립의 경영진\n\n\n👦팀원 미니 인터뷰1 - 강**님\n항공시스템이 역사가 긴 만큼 매력적인 서비스 중 하나라고 생각합니다.\n서비스 구성을 살펴보면 상당히 재미있고 흥미로운 점들을 많이 느끼고 배울 수 있습니다. 또, 팀원들과의 토론과 협업으로 많은 것을 알게 되고 서로에게 많은 의지와 보탬이 될 수 있다는 점도 좋습니다. 우리의 목표는 마리트를 이용해 주시는 고객에게는 '여행'이라는 좋은 추억이 될 수 있도록 보다 나은 서비스를 제공하고, 그안에서 즐거움을 느끼며 성장합니다.\n👦팀원 미니 인터뷰2 - 김**님\n항공업무는 다양한 항공사와 GDS(Global Distribution System)에서 제공하는 기능을 사용자 및 관리자가 편리하게 이용할 수 있도록 수정및 개발하는 업무를 주로 이루고 있습니다. 항상 사용자 및 관리자가 사용하기 편리한 방법을 찾아 개발을 진행하고 있으며 자유로운 분위기에서 자신의 계획대로 업무를 진행할 수 있다는 점에서 좀 더 재미있고 효율적으로 일을 진행할 수 있어요.\n[담당업무]\n\n차세대 항공 플랫폼 설계, 개발 및 운영\n항공 탐색 및 예약/결제 경험 고도화를 위한 예약발권 시스템 개발 및 운영\n항공 서비스의 운영 효율화를 위한 백오피스 개발 및 운영",
