         "positionInfo": "직무 소개: \nGrowth Engineering팀은 내부/외부 마케팅 활동을 통해 수요를 창출하고 고객을 유입시키며 충성도를 제고하여 쿠팡의 고객기반 및 매출을 증대시키는 역할을 담당하며, 수작업이 아닌 데이터를 기반으로 한 자동화된 인텔리전트한 의사결정을 통해 고객과의 접점과 커뮤니케이션을 강화하고자 합니다. 이를 위해, 확장성 있는 전사적 마케팅 시스템 및 플랫폼을 개발하여 쿠팡이 구매자 중심 마케팅 기술의 글로벌 선두주자가 되도록 합니다.\n업무 내용:\n\n비즈니스팀과 PO 분들과 함께 시스템의 주요 Feature를 정의하고 개발을 리드한다.\nSDM으로서 엔지니어링 팀을 기술적으로 리드하고 관리한다.\n팀에서 개발이 필요한 feature들에 대해서 우선순위를 결정하고 스프린트 플래닝을 진행한다.\n팀의 개발 생산성을 높이기 위해 팀 내에 적절한 프로세스를 확립한다.\n팀원 개개인의 성장을 위해서 팀원들을 독려하고 지도한다.",
