         "link": "https://programmers.co.kr/job_positions/3127",
         "positionInfo": "🚀 마이리얼트립 슈퍼 채용\n\n[직무소개]\n\"우리는 모든 경험을 연결하여 여행을 혁신합니다.\"\n마이리얼트립은 고객과 데이터를 중심의 최고의 여행 서비스를 개발합니다. 전 세계의 항공, 숙박, 교통, 투어&액티비티 상품들을 효과적으로 관리하고, 서로 다른 상품들의 경험을 통일하여 쉽고, 편리한 탐색/예약/구매 경험을 제공하기 위해 노력합니다. 최고 수준의 기술로 기존에 존재하지 않는 새로운 여행 경험을 제시하고자 합니다.\n🕵️‍♂️ 마이리얼트립 제품 개발 조직은 이렇게 일합니다.\n👉 데이터를 기반으로 고객에게 최상의 임팩트를 제공하기 위해 모든 구성원이 함께 치열하게 고민합니다. 데이터를 기반으로 문제를 정의하고, 제품/사업/운영 조직이 함께 해결책을 모색합니다. 모든 조직이 최상의 결과물을 얻기 위해 치열하게 도전합니다.\n👉 고객의 소리에 집중합니다. 우리가 고객이 가지고 있는 문제에 집중하며, 그 문제를 단순히 풀어내는 것이 아니라, 10배, 100배 더 잘 풀어내기 위해 끊임없이 고민합니다.\n👉 상호존중과 신뢰를 기반으로 함께 성장합니다. 우리팀은 나이/연차와 무관한 강한 책임감을 가지고 각자 맡은 업무를 주도적으로 진행하며, 동료들과 더 나은 서비스를 위하여 자유롭게 의견을 개진합니다. 그리고 경쟁이 아닌 함께 성장하는 문화를 만들어가고자 합니다.\n💡 마이리얼트립 프로덕트 조직의 일하는 방식과 문화에 대해서는 아래 블로그에서 더 자세히 참고하실 수 있습니다.\n\n마이리얼트립 Product Team Blog\n[Job터뷰: C-Level]기술을 통해 여행 시장을 혁신하는 마이리얼트립의 경영진\n\n\n※ Java 백엔드 개발자는 아래 4개의 도메인에서 채용하고 있습니다. 소속 도메인은 최종합격시 지원자에게 적합한 도메인으로 협의 후 결정됩니다.\n👨‍🏫 예약/결제/정산 도메인 개발\nPayment 개발팀은 커머스 플랫폼의 핵심인 주문/예약/결제/환불/정산 시스템을 개발합니다. 또한 고객에게 혜택을 제공하기 위한 쿠폰/포인트 시스템을 개발합니다. 우리는 고객의 안전하고 편리한 구매 경험을 제공하고 대규모 트래픽 환경하에서도 안정적인 서비스 운영이 가능하도록 다양한 기술적인 도전을 시도합니다. 이러한 여정에 함께 할 열정있는 개발자를 찾고 있습니다.\n[담당업무]\n\n마이리얼트립 주문/예약/결제/환불/정산 도메인 설계 및 개발\n마이리얼트립 쿠폰/포인트 시스템 설계 및 개발\n마이리얼트립 Payment 시스템의 신뢰도와 안정성 확보를 위한 기술 활동 (HA구성, 자동복구, 장애차단, 부정행위 검출 등)\n\n\n👨‍🏫 숙박&교통 도메인 개발\nStay&Ride개발팀은 여행의 필수 요소인 숙박, 교통 서비스를 개발합니다. 우리는 고객이 원하는 장소로 이동하거나, 머물수 있도록 국내외 다수의 OTA들과 협업하고 있으며, 고객에게 최상의 탐색/예약 경험을 제공하기 위한 서비스를 개발합니다. 서로 분리된 항공, 교통(기차/버스/렌터카), 숙박 서비스의 연결을 통해 최고의 여행 경험을 제공하고, 여행지에서도 편안함을 느낄 수 있는 신뢰도 높은 서비스를 만들어갑니다\n[담당업무]\n\n마이리얼트립에서 제공하는 항공, 숙박, 교통 서비스의 Backend 서버스 개발\n국내외 OTA(Online Travel Agency), GDS(Global Distribution System) 연동 시스템 개발\n리뷰 및 평점 시스템 개발\n상품 검색 시스템 및 랭킹 알고리즘 개발\n실시간 서비스 모니터링 및 복구 시스템 개발\n\n\n👨‍🏫투어&액티비티 도메인 개발\nExperience 개발팀은 여행의 필수 요소인 투어&액티비티 서비스를 개발합니다. 마이리얼트립은 현재 국내 최대인 수만개의 투어&액티비티 상품을 700여개의 도시에서 제공하고 있으며, 고객에서 나다운 여행이 될 수 있도록 최고의 현지경험을 제공하고자 합니다. 이를 위해 국내외 여러 OTA들과 협업과 연동 시스템을 통해 더 많은 여행 경험을 제공하고 있기 위한 서비스를 만들어 가고 있습니다.\nExperience 개발팀에 대해서는 이 글을 통해 더 자세히 확인하실 수 있습니다.\n[담당업무]\n\n차세대 투어&액티비티 플랫폼 서비스 설계 및 개발\n마이리얼트립에서 제공하는 투어&액티비티 서비스의 Backend 서비스 개발 및 운영\n국내외 OTA(Online Travel Agency)와의 연동 시스템 개발 및 운영\n투어&액티비티 서비스의 운영 효율화를 위한 백오피스 개발 및 운영\n\n\n👨‍🏫 공통 플랫폼 개발\n우리는 각 백엔드 도메인에서 공통적으로 발생하는 복잡한 문제들을 들여다보며, 이를 위해 최고 수준의 솔루션을 개발합니다. 궁극적으로 10배 이상의 비즈니스 성장까지도 유연하게 확장 할 수있는 Micro Service 플랫폼 생태계를 구축하고자 합니다. Software life cycle 에서 신뢰성, 확장성, 생산성을 높일수 있는 플랫폼 구축 뿐 아니라, 회원, 이미지, 동영상과 같은 서비스 플랫폼 구축도 함께 담당하고 있습니다. 우리는 각 조직의 유능한 엔지니어 그룹과 협력하여 전사 프로젝트를 리딩합니다.\n[기술스택]\n\nKotlin, Java, Gradle\nSpring MVC, Spring Boot\nJPA/Hibernate, MyBatis, MySQL, MongoDB, ElasticSearch, Redis\nNginx\nGit, Docker, Jenkins\nKafka, ELK, Prometheus, Grafana\n\n\n[담당업무]\n\n공통 회원 및 인증 시스템 설계 및 개발\n백엔드 / 클라이언트 간의 API 및 데이터 Aggregation/Decoration 시스템 설계 및 개발\n높은 수준의 응답성을 보장하는 통합 상품 데이터 서비스 개발 및 운영\nAWS 환경의 복잡한 기술 문제를 해결하고, 운영 효율성을 확대",
