         "positionInfo": "한국에서 350만명, 미국에서 150만명이 하루 평균 40분 사용하는 블라인드 서비스는 성장 가능성을 인정 받아 국내외 유명 벤처캐피탈로부터 총 250억원 규모 투자를 받았으며, 2021년 5월에는 시리즈C 3700만 달러 (약 416억) 투자를 추가 유치했습니다.\n관련기사 👉 블라인드, 시리즈C 3700만 달러 투자 유치\n\n\n미국 최대 IT 전문지 테크크런치,\"재택근무가 일상이 된 오늘 블라인드는 직장인들에게 없어서는 안 될(indispensable) 서비스가 됐다\"\n영국 M&A 전문지 머저마켓,\"블라인드는 마이크로소프트 재직자의 90%, 페이스북 재직자의 70%를 가입자로 보유한 압도적인 서비스\"\n\n\n2025년, 나스닥 상장 목표\n\n블라인드는 설립 시점부터 글로벌 확장을 목표로 했습니다. 이번 투자로 미국 본사와 한국에서의 확장은 물론, 캐나다와 인도 등 주요 국가에 거점을 둔 글로벌 플랫폼으로 도약할 예정입니다.\n\n팀블라인드는 불필요한 추가 근무를 지양하는 업무 문화를 가지고 있고, 개발팀이 업무에 집중할 수 있도록 최선의 지원을 하고 있어요. 안정적이고 견고한 서비스는 팀 차원의 밑바탕이 충분해야 가능하다고 생각해요. 블라인드의 개발팀은 이 점을 잘 이해하고 함께 성장하고자 합니다.\n\n\n신규 개발 및 기능 개선: 팀블라인드가 운영하는 다양한 서비스들의 기능을 지속적으로 개발하고 개선해요. 이 과정에서 기획/클라이언트개발/디자인/QA 등 분야 전문가들과 함께 최선의 결과를 이끌어내는데 중추적인 역할을 담당하고 있어요.\n모니터링과 최적화: 정기적인 모니터링을 통해 예상치 못한 버그를 찾아내고, 지속적인 배포를 해요. 최적화가 가능한 지점을 찾아내고 개선하고 있어요. 우리 서비스의 사용자들이 최대한 불편을 겪지 않도록 노력해요. 기술적인 모니터링에 더해서 데이터 분석팀과의 협력을 통해, 이상 징후가 있으면 바로 뛰어들어 분석하고 해결해요.\n코드 및 기술 개선: 버그가 적고, 수정과 기능개선에 유연한 대응이 가능한 코드를 작성하기 위해 최선을 다하고 있어요. 문제를 해결하는데 더 나은 방법이 있다면 서로 기술적인 의견을 나누고 도움을 주는데 주저하지 않아요. 한 사람이 없으면 아무것도 할 수 없는 팀 보다, 모두가 유기적으로 어떤 문제라도 대응할 수 있는 팀이 되려고 해요. 블라인드 개발팀은 코드와 아키텍처상의 보안적인 부분에도 많은 노력을 기울이고 있어요.",
