         "positionInfo": "▶ CLO Virtual Fashion은 어떤 회사인가요?\nCLO Virtual Fashion (이하 클로) 은 3D 의상 소프트웨어 CLO(https://www.clo3d.com)와 Marvelous Designer(www.marvelousdesigner.com)를 만들고, 3D 의상 데이터 플랫폼(https://www.clo-set.com) 시장을 선도하고 있는 패션 Tech 기업입니다.\n본사는 서울 신사역 부근에 있지만, 뉴욕, 뮌헨, 상하이, 홍콩, 인도에 지사가 있습니다. 전체 직원의 약 50%가 해외 패션 디자이너들과 마케터들이며, 개발자들과 늘 함께 소통하며 일합니다. 또한 제주도의 제주 첨단 과학기술 단지 안에 제주지사(힐링오피스)가 마련되어 있어서, 클로의 직원이라면 누구나 한달간 제주도에서 근무할 수 있습니다. (숙소 및 비행기표 제공)\n클로버추얼패션 개발자의 생생한 인터뷰: https://youtu.be/rGRY5X84UYo\n▶ MarvelousDesigner는 어떤 소프트웨어인가요?\n• Marvelous Designer는 EA, Ubisoft, Rockstar Games 등 세계 여러 게임 회사에서 캐릭터의 의상을 만드는 데에 중요하게 사용하고 있는 소프트웨어입니다.\n• 또한 Disney, Dreamworks등의 여러 영화 회사에서도 Marvelous Designer를 통해 의상을 만들고 있습니다. 애니메이션 ‘겨울왕국’의 주인공 ‘엘사’의 다양하고 화려한 의상을 구현한 것도 클로버추얼패션의 솔루션을 통해 이루어졌으며, 전 세계적으로 큰 화제가 된 바 있습니다.\n(https://www.vox.com/the-goods/2019/11/18/20970465/frozen-2-costumes-design-animate-anna-elsa)\n• Epic Games와 긴밀한 관계를 맺고 여러 프로젝트를 진행 중입니다.\n\n주요업무\nCLO Virtual Fashion의 Unreal Developer는 Epic Games와 직접 협업하고 Unreal Engine의 신규 기술을 체험/적용함으로써 전통적인 패션산업을 테크분야로 전환시키는 선두주자로서 역할합니다.\n\nUnreal Engine에 자사의 SDK를 사용한 플러그인 및 어플리케이션을 개발합니다.\nEpic Games와 함께하는 Unreal Engine 관련 여러 프로젝트를 경험할 수 있습니다.\nMarvelous Designer 유저의 피드백을 Unreal Engine의 기술을 통해 실제로 구현합니다.",
