         "positionInfo": "“진짜 재미있고 흥미로운 서비스를 만들어보자!”\n모젯은 데이팅 시장에 어떤 가치를 창출할 수 있을까 고민하며 국내 최초로 소셜데이팅 앱 서비스를 시작했습니다.\n시장의 개척자로 첫 발걸음을 내딛은 후 지금까지 우리는 다양한 데이터와 알고리즘에 의해 훨씬 더 좋은 상대를 소개해줄 수 있고 그것이 더 좋은 결과를 낳을 수 있다는 것을 알게 되었습니다.\n이와 같은 신념과 철학을 바탕으로 정오의데이트는 2011년 출시된 이래 10년간 소셜데이팅 앱 분야에서 상위권을 랭크하고 있으며, 지금까지 누적회원 수 277만건 이상, 매일 약 3만 건의 커플이 연결되고 있습니다.\n모젯은 여기에서 멈추지 않습니다. 데이팅 앱 분야의 선구자로 지금까지 달려왔고, 또 다른 새로운 분야의 선두주자가 되기 위해 출발선에 서있습니다.\n현재 모젯에서 새롭게 준비 중인 신사업 서비스는 패션 및 라이프스타일에 대한 이해를 바탕으로, 럭셔리를 추구하는 2030 소비자들을 위한 웹/모바일 서비스, 해외 명품 직구 콘텐츠를 한 눈에 볼 수 있는 플랫폼 사업을 만들어 나가고 있습니다. 이에 APP/WEB 서비스 개발에 대한 역량과 자신감을 바탕으로 좋은 서비스와 개발 문화를 만들어 나갈 분을 기다립니다.\n#모젯의 핵심가치\n1. Zeitgeist\n우리는 현 시대와 어울리는 다양한 만남을 제안합니다.\n2. Be Customer-oriented\n우리는 고객의 즐거움에 가장 집중합니다\n3. Be Team Player\n우리는 팀을 위하는 일이 우선순위가 됩니다\n4. Be Disruptive\n우리는 업무의 경계를 허물고 스마트하게 일합니다\n5. Pursue Growth\n우리는 더 잘하기 위해 노력합니다\n[모젯, 이런 분을 기다립니다!]\n- 성장 가능성이 무궁무진한 소셜데이팅 기업에서 일하고 싶은 사람!\n- 매출 상승이 날로 높아지는 우수기업에서 일하고 싶은 사람!\n- 수평적 기업문화에서 빠르게 개인역량을 키우고 싶은 사람!\n- 자신의 능력을 인정 받으면서 즐겁게 일하고 싶은 사람!\n\n[모젯CEO 인터뷰]\nhttp://blog.noondate.com/221342453608\n\n[주요업무]\n• 패션, 명품 이커머스 백엔드 플랫폼 개발\n• 해외 명품 정보 크롤링 및 고도화\n[기술스택]\n• Typescript, Nest.js\n• AWS Cloud\n• TypeOrm, Mysql\n• Redis, ElasticSearch\n• puppeteer, axios, cheerio등을 이용 크롤링\n• monorepo기반 모듈 개발\n• Jest 를 이용한 Unit Test",
