         "link": "https://programmers.co.kr/job_positions/5541",
         "positionInfo": "클로버추얼패션(CLO Virtual Fashion Inc.)은 3D 의상 소프트웨어 CLO(https://www.clo3d.com)와 Marvelous Designer(www.marvelousdesigner.com)를 만들고, 3D 의상 데이터 플랫폼(https://www.clo-set.com) 시장을 선도하고 있는 패션 Tech 기업입니다.\n루이비통, 아디다스, 나이키, 프라다와 같은 글로벌 패션 기업뿐만 아니라, EA, UbiSoft, Koei, Disney, Lucas Film 등 세계적으로 유명한 게임, CG회사들에서도 저희 소프트웨어을 사용하고 있습니다. 애니메이션 ‘겨울왕국’의 주인공 ‘엘사’의 다양하고 화려한 의상을 구현한 것도 클로버추얼패션의 솔루션 통해 이루어졌으며, 전 세계적으로 큰 화제가 된 바 있습니다.\n본사는 서울 신사역 부근에 있지만, 뉴욕, 뮌헨, 상하이, 홍콩, 인도에 지사가 있습니다. 전체 직원의 약 50%가 해외 패션 디자이너들과 마케터들이며, 개발자들과 늘 함께 소통하며 일합니다. 또한 제주도의 제주 첨단 과학기술 단지 안에 제주지사(힐링오피스)가 마련되어 있어서, 클로의 직원이라면 누구나 한달간 제주도에서 근무할 수 있습니다. (숙소 및 비행기표 제공)\n▶원티드 - 좋은 기업을 시리즈를 통해 클로버추얼패션에 대해 알아보세요!\nhttps://url.kr/FhoTYO\n▶공식 홈페이지에 방문해서 CLO의 세계를 경험하세요!\nhttp://www.clovirtualfashion.com\n\n전 세계 유저들의 요구 사항을 분석하여 새로운 기능을 만들고 최첨단 의상 시뮬레이션 기술을 연구해 나갈 분들을 모집합니다!\n특히 컴퓨터 그래픽스/비전 관련 기술에 관심이 많거나, C/C++ 기반의 소프트웨어 개발 능력이 있으신 모든 분들의 지원을 기다립니다.\n▶︎ 지원하실 때 이것을 제출해 주세요.\n• 경력사항이 잘 기술된 이력서(경력기술서) 1부\n• 포트폴리오, 본인이 참여한 프로젝트 내용이 정리된 레퍼런스 (포트폴리오, 논문 혹은 Git과 같은 repo)\n\n주요업무\n\nCLO 와 MarvelousDesigner를 사용하는 전 세계 유저들의 요구사항을 분석하여, 그에 맞는 새로운 기능을 만들어 나갑니다.\n최첨단 의상 시뮬레이션 기술을 경험/연구하고, 최적화 해나가는 일을 합니다.\n최신 렌더링 기술을 경험/연구하고, 의상에 최적화된 렌더링 기술을 개발합니다.\nQT Framework 을 사용하여 Windows와 Mac에서 cross-platform으로 동작하는 최적의 UI를 개발합니다.\nAPI/SDK를 개발하여, 다양한 게임엔진(Unity, Unreal) 과 연동되는 시스템을 구축합니다.\n\n\n\nCLO 는 입사할 때 담당할 개발 업무를 확정하지 않습니다. 입사 후 3개월간의 온보딩 과정을 통해 신규 입사자의 관심과 역량에 가장 잘 맞는 업무를 찾아가도록 도와드릴게요!",
