         "positionInfo": "회사 소개\n1. 조아라의 미래\n조아라의 슬로건은 Awaken Story Instinct 입니다.\n인간이라면 누구나 가지고 있는 스토리 본능으로 언제라도 어디에서라도 누구나 글을 쓰고 올릴 수 있는 세상을 꿈꾸고 있습니다.\n그것을 위해서 우리는 이루고 싶은 일들이 아주 많습니다.\n- 전세계 같은 언어를 쓰는 사람이라면 어디에 살든 같은 시간에 같은 글을 읽을 수 있게 만드는 것\n- 20만 동시접속자 숫자가 100만으로 늘어나더라도 여전히 안전하고 튼튼한 서비스를 만드는 것\n- Deep Learning 기술을 이용한 작품 추천 엔진의 만족도를 더욱 높이는 것\n- 작가/독자 사이의 모든 활동을 데이터로 저장/추적/분석하여 더 나은 서비스를 제공하는 것\n- 그 데이터들을 이용하여 '검색엔진'의 결과물들을 더 Smart 하게 만드는 것\n2. 미래를 위해 지금 해야할 일\n그래서 조아라 개발자들은 해야할 일이 많습니다.\n- AWS 나 GCP 위에서 적절한 분산 Database 를 활용하여 전세계 자료를 실시간 동기화 하는 것\n- 적절한 Memory Data store 를 활용하여 빠른 반응속도를 보이는 Data Layer 계층을 구축하는 것\n- 작품 선호도 파악을 위하여 사용자 활동을 측정할 수 있는 요소를 정의하고\n- Data Pipeline 과 적절한 Dataware House 를 활용하여 사용자의 선택을 돕는 것\n- 동료가 효율적으로 개발할 수 있도록 의존성을 줄이는 설계를 하며\n- 실수를 줄이도록 Peer Review 를 해주고 테스트를 효율적으로 자동화하는 것\n- 팀의 개발 규칙을 바탕으로 Continuous Integration & Deployment 를 통해 점진적으로 개선하며 협업하는 것\n- 나의 성장을 바탕으로 동료와 서비스의 성장을 만들어 내는 것\n대충 기술 키워드로 정리하면\n- GCP,AWS,Spanner,Kubernetes,Redis,PubSub,Machine Learning,BigQuery,DataStudio,AI, Data Pipeline, Agile, Scrum, Sprint, Test Automation, CI/CD, Peer Review, Retrospective\n할 일이 너무 많은가요?\n3. 조아라 개발자의 성장계획\n조아라 모바일 개발파트의 K대리님은 **'해보고 싶은 일이 많다'**고 매우 행복해 하셨습니다.\n- 지금은 AOS,iOS App 을 개발하고 있는데\n - Firebase Analytics 의 Event 를 App Code 내에 심어 BigQuery + Data Studio 로 사용자를 분석하고 싶고\n - Android 에서 익힌 Java 실력으로 Spring Boot API 개발을 하면서 Back End 맛도 보고 싶으며\n - 성능확보를 위하여 분산 Database 와 Memory Store 에 대한 지식을 쌓아\n - 최종적으로는 세계 10개국에서 동시에 구동하는 Global Joara Platform 의 Architect 가 되는 꿈을 꾸고 있답니다.\n주요업무\n\n조아라 서비스의 Native App 사용자 화면 개발\nBusiness Model 의 빠른 검증을 위한 하이브리드 App 제작\nAOS,iOS 인앱결제 구현\n작가/독자 성향분석 Chart/Graph 개발\nText Contents 의 Smart Viewer 제작\n작가/독자 행동 분석을 위한 Analytics 적용 및 분석\nFlutter / React / Kotlin 등 기술 분석 및 도입",
