         "positionInfo": "“We Learn Anything, Anytime, Anywhere”는 브랜드명 처럼 윌라(welaaa)는 언제 어디서나 무엇이든 듣고 보며 배우고 즐길 수 있는 서비스를 제공하고자 노력해왔습니다. 국내 최초로 AWS 클라우드를 통해 모바일 스트리밍을 완벽하게 지원하는 완성도 높은 오디오북 플랫폼 서비스를 선보이며, 국내 오디오북 브랜드 1위를 달성하였습니다. 이에 머물지 않고 클래스와 라이브 강연서비스 등 다양한 지식콘텐츠 분야로 확장하고 R&D 투자에 집중하며 ‘No1. 지식콘텐츠 플랫폼’으로 성장하고 있습니다. 윌라는 혁신적인 기술력을 통해 최고의 지식콘텐츠를 세상에 전파하고자, 콘텐츠 기업을 넘어 IT 기업으로의 혁신을 추구하고 있습니다.\n　\n윌라에서는 경험 많은 경영진들과 업계 최상위 스타트업에서 온 개발팀 및 각 분야 최고의 전문가들이 자율과 책임의 문화 속에서 활기차게 일하고 있습니다.  지식에 대한 상식을 바꾸는 가슴 뛰는 경험을 최고의 동료들과 함께할 멋진 동료를 기다립니다.\n　\n윌라는 이런 성과를 이뤄냈습니다\n　\n• 누적 다운로드 190만\n• 누적 회원수 144만\n• 시리즈 B 펀딩 완료(총 누적 투자액 210억)\n• 대한민국 브랜드 만족도 1위 수상\n• 구글 플레이 교육앱 매출 1위 달성\n　\n윌라의 개발환경\n　\n윌라는 사용자에게 서비스를 제공하기위해 React, React-Native 및 App-Native를 이용하여 개발되었고, AWS Cloud환경에서 Elastic beanstalk를 기반으로 자동화, 모니터링 및 분산환경을 구축하고 있습니다.\n이런 서비스를 만들기 위한 주요 개발업무들은 다음과 같습니다.\n　\n• 웹 및 모바일 앱 기반의 서비스 구축\n• ERP 및 B2B/B2C 서비스 관리자페이지 개발\n• 멀티미디어 콘텐츠 변환 및 자동화 지원\n• 사용자 앱 이용데이터 분석 및 피드백\n　\n또한 개발업무의 역량 강화를 위해 스프린트기반의 Daily 이슈공유(스크럼)와 코드리뷰 개발문화를 지향합니다.\n　\n주요업무\n　\n[Infra]\n• AWS Paas/Beanstalk, Lambda, EC2\n• DNS, S3, CDN/Cloud Front 설정 및 모니터링\n[Database]\n• RDS(MySQL), ORM을 이용한 서비스개발\n• Redis 메모리 캐쉬 및 성능개선\n[APP]\n• Python Flask F/W REST API 구현\n• 윌라 Backoffice 및 멀티미디어 기반 대용량 콘텐츠 관리",
